tent or file format like ( Images, Videos, Zip files, …) and much more!\";s:17:\"short_description\";N;s:10:\"banner_url\";s:67:\"https://s3-us-west-2.amazonaws.com/freemius/plugins/5792/banner.jpg\";s:15:\"card_banner_url\";s:72:\"https://s3-us-west-2.amazonaws.com/freemius/plugins/5792/card_banner.jpg\";s:15:\"selling_point_0\";s:64:\"Enable the Pay For Submissions functionality for individual form\";s:15:\"selling_point_1\";s:64:\"Decide if you want to go to the card or directly to the checkout\";s:15:\"selling_point_2\";s:25:\"Save as Draft or Purchase\";s:11:\"screenshots\";N;s:2:\"id\";s:4:\"1783\";s:7:\"updated\";s:19:\"2020-09-25 09:11:56\";s:7:\"created\";s:19:\"2020-08-26 07:31:21\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:17:\"opt_in_moderation\";N;s:10:\"public_key\";s:32:\"pk_e9894aaa5dfe2457936ca6e7bfd9b\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"5792\";s:7:\"updated\";s:19:\"2023-05-24 08:37:27\";s:7:\"created\";s:19:\"2020-03-26 15:11:21\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:18;O:9:\"FS_Plugin\":24:{s:16:\"parent_plugin_id\";s:3:\"391\";s:5:\"title\";s:22:\"BF HubSpot Integration\";s:4:\"slug\";s:30:\"buddyforms-hubspot-integration\";s:12:\"premium_slug\";s:38:\"buddyforms-hubspot-integration-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:0;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:5:\"11175\";s:11:\"description\";s:336:\"<h2>Send Form Submissions to HubSpot</h2>\nHubSpot will auto-detect the client by email address or create a new client from submissions made with BuddyForms. Please find more information on how to set up HubSpot wIth BuddyForms here:\n\n<a href=\"https://docs.buddyforms.com/article/787-how-to-integrate-buddyforms-with-hubspot\">HubSpot</a>\";s:17:\"short_description\";s:116:\"By using this extension you will be able to easily manage through HubSpot the information that is sent in our forms.\";s:10:\"banner_url\";s:68:\"https://s3-us-west-2.amazonaws.com/freemius/plugins/11175/banner.png\";s:15:\"card_banner_url\";s:73:\"https://s3-us-west-2.amazonaws.com/freemius/plugins/11175/card_banner.png\";s:15:\"selling_point_0\";s:67:\"Collect the data from your BuddyForms fields and send it to HubSpot\";s:15:\"selling_point_1\";s:77:\"Create a new contact on the HubSpot platform after each BuddyForms submission\";s:15:\"selling_point_2\";s:47:\"Manage your form fields according to your needs\";s:11:\"screenshots\";N;s:2:\"id\";s:4:\"3093\";s:7:\"updated\";s:19:\"2022-10-06 03:22:33\";s:7:\"created\";s:19:\"2022-10-04 08:08:21\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:17:\"opt_in_moderation\";N;s:10:\"public_key\";s:32:\"pk_68d5ed27fb9d5f2bfb3e14612d42b\";s:10:\"secret_key\";N;s:2:\"id\";s:5:\"11175\";s:7:\"updated\";s:19:\"2023-01-14 15:10:32\";s:7:\"created\";s:19:\"2022-09-30 13:44:57\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}}}}', 'yes');
