(3582, 'mec_options', 'a:4:{s:8:\"settings\";a:7:{s:24:\"multiple_day_show_method\";s:18:\"first_day_listgrid\";s:18:\"google_maps_status\";i:1;s:20:\"export_module_status\";i:1;s:2:\"sn\";a:7:{s:9:\"googlecal\";i:1;s:4:\"ical\";i:1;s:8:\"facebook\";i:1;s:5:\"gplus\";i:1;s:7:\"twitter\";i:1;s:8:\"linkedin\";i:1;s:5:\"email\";i:1;}s:16:\"countdown_status\";i:1;s:21:\"social_network_status\";i:1;s:20:\"default_skin_archive\";s:13:\"full_calendar\";}s:6:\"styles\";a:1:{s:3:\"CSS\";s:0:\"\";}s:8:\"gateways\";a:1:{i:1;a:1:{s:6:\"status\";i:1;}}s:13:\"notifications\";a:9:{s:20:\"booking_notification\";a:3:{s:7:\"subject\";s:25:\"Your booking is received.\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:232:\"Hello %%name%%,\n\n                    Your booking is received. We will check and confirm your booking as soon as possible.\n                    Thanks for your patience.\n\n                    Regards,\n                    %%blog_name%%\";}s:18:\"email_verification\";a:3:{s:7:\"subject\";s:27:\"Please verify your booking.\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:198:\"Hi %%name%%,\n\n                    Please verify your booking by clicking on following link:\n\n                    %%verification_link%%\n\n                    Regards,\n                    %%blog_name%%\";}s:20:\"booking_confirmation\";a:3:{s:7:\"subject\";s:26:\"Your booking is confirmed.\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:288:\"Hi %%name%%,\n\n                    Your booking is confirmed. You should be available at %%book_date%% in %%event_location_address%%.\n\n                    You can contact to event organizer by calling %%event_organizer_tel%%.\n\n                    Regards,\n                    %%blog_name%%\";}s:25:\"cancellation_notification\";a:7:{s:6:\"status\";s:1:\"0\";s:7:\"subject\";s:25:\"Your booking is canceled.\";s:10:\"recipients\";s:0:\"\";s:13:\"send_to_admin\";s:1:\"1\";s:17:\"send_to_organizer\";s:1:\"0\";s:12:\"send_to_user\";s:1:\"0\";s:7:\"content\";s:182:\"Hi %%name%%,\n\n                    For your information, your booking for %%event_title%% at %%book_date%% is canceled.\n\n                    Regards,\n                    %%blog_name%%\";}s:18:\"admin_notification\";a:3:{s:7:\"subject\";s:26:\"A new booking is received.\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:253:\"Dear Admin,\n\n                    A new booking is received. Please check and confirm it as soon as possible.\n\n                    %%admin_link%%\n\n                    %%attendees_full_info%%\n\n                    Regards,\n                    %%blog_name%%\";}s:9:\"new_event\";a:4:{s:6:\"status\";s:1:\"1\";s:7:\"subject\";s:21:\"A new event is added.\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:316:\"Hello,\n\n                    A new event just added. The event title is %%event_title%% and its status is %%event_status%%.\n                    The new event may need to be published. Please use this link for managing your website events: %%admin_link%%\n\n                    Regards,\n                    %%blog_name%%\";}s:21:\"user_event_publishing\";a:4:{s:6:\"status\";s:1:\"1\";s:7:\"subject\";s:25:\"Your event gets published\";s:10:\"recipients\";s:0:\"\";s:7:\"content\";s:217:\"Hello %%name%%,\n\n                    Your event gets published. You can check it below:\n\n                    <a href=\"%%event_link%%\">%%event_title%%</a>\n\n                    Regards,\n                    %%blog_name%%\";}s:13:\"event_soldout\";a:6:{s:6:\"status\";s:1:\"0\";s:7:\"subject\";s:22:\"Your event is soldout!\";s:10:\"recipients\";s:0:\"\";s:13:\"send_to_admin\";s:1:\"1\";s:17:\"send_to_organizer\";s:1:\"1\";s:7:\"content\";s:175:\"Hi %%name%%,\n\n                    For your information, your %%event_title%% event at %%book_date%% is soldout.\n\n                    Regards,\n                    %%blog_name%%\";}s:17:\"booking_rejection\";a:7:{s:6:\"status\";s:1:\"0\";s:7:\"subject\";s:26:\"Your booking got rejected!\";s:10:\"recipients\";s:0:\"\";s:13:\"send_to_admin\";s:1:\"0\";s:17:\"send_to_organizer\";s:1:\"1\";s:12:\"send_to_user\";s:1:\"1\";s:7:\"content\";s:182:\"Hi %%name%%,\n\n                    For your information, your booking for %%event_title%% at %%book_date%% is rejected.\n\n                    Regards,\n                    %%blog_name%%\";}}}', 'yes'),
