(3592, 'mec_custom_msg_2_html', '<link rel = \"stylesheet\" type = \"text/css\" href = \"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/style2.css\" /><div class=\"mec-custom-msg-2-notification-set-box extra\"><div style=\"margin: 0\" class=\"w-row mec-custom-msg-notification-wrap\"><div class=\"w-col-sm-12\"><div class=\"w-clearfix w-box mec-cmsg-2-notification-box-wrap mec-new-addons-wrap\" style=\"margin-top:0;\"><div class=\"w-box-head\">Announcement<span><i class=\"mec-sl-close\"></i></span></div><div class=\"w-box-content\"><div class=\"mec-addons-notification-box-image\" style=\"width: 240px; margin-right: 10px;\"><img src=\"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/square-integration-addon.svg\" /></div><div class=\"mec-addons-notification-box-content mec-new-addons\" style=\"width: calc(100% - 270px);\"><div class=\"w-box-content\"><div class=\"csm-message-notice\" style=\"text-align: center; background: #BAF0FC57; border-radius: 6px;letter-spacing: 4.4px; color: #00CAE6; text-transform: uppercase; padding: 10px 5px; font-weight: bold; margin-bottom: 40px;\">Square Payment</div><p>As promised, another one of the most-requested addons by you, Square Payment, is released this week. The first six addons are out already. Webex Integration and Social Auto Poster and Elementor FES Builder and Seat and Gutenberg Single Builder and Square Payment are now available on our website for purchase.<br/></p><div style=\"clear:both\"></div><a href=\"https://webnus.net/modern-events-calendar/addons/square-payment/?ref=17\" target=\"_blank\">Read More</a></div></div></div></div></div></div></div>', 'yes'),
