(15952, 'pmpro_addons', 'a:99:{i:0;a:16:{s:4:\"Name\";s:44:\"Paid Memberships Pro - Add Member From Admin\";s:5:\"Title\";s:44:\"Paid Memberships Pro - Add Member From Admin\";s:9:\"PluginURI\";s:67:\"https://www.paidmembershipspro.com/add-ons/add-member-admin-add-on/\";s:4:\"Slug\";s:22:\"pmpro-add-member-admin\";s:6:\"plugin\";s:49:\"pmpro-add-member-admin/pmpro-add-member-admin.php\";s:7:\"Version\";s:5:\"0.7.1\";s:11:\"Description\";s:48:\"Allow admins to add members in the WP dashboard.\";s:12:\"Installation\";s:502:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-add-member-admin</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships -&gt; Add Member to add a new member.</li>\n<li>When viewing the member\'s list or user\'s list in the dashboard a \"+ order\" link will show up under the username that can be used to add a new order for an existing user through the same form.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:314:\"<h4>Changelog</h4><p>0.7.1 - 2022-04-14</p><ul>\n<li>BUG FIX: Fixed admin email template data showing incorrect user information for recently added member.</li>\n<li>BUG FIX: Reverted changes for the \"+order\" link URL, this would require further thought and plans to adjust in the future than anticipated.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:83:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-add-member-admin.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Add Member From Admin\";}i:1;a:16:{s:4:\"Name\";s:50:\"Paid Memberships Pro - Add Name to Checkout Add On\";s:5:\"Title\";s:50:\"Paid Memberships Pro - Add Name to Checkout Add On\";s:9:\"PluginURI\";s:75:\"https://www.paidmembershipspro.com/add-ons/add-first-last-name-to-checkout/\";s:4:\"Slug\";s:26:\"pmpro-add-name-to-checkout\";s:6:\"plugin\";s:57:\"pmpro-add-name-to-checkout/pmpro-add-name-to-checkout.php\";s:7:\"Version\";s:5:\"0.6.1\";s:11:\"Description\";s:97:\"Adds first and last name fields to the user account section at checkout for Paid Memberships Pro.\";s:12:\"Installation\";s:272:\"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-add-name-to-checkout</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:575:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-add-name-to-checkout/issues\">https://github.com/strangerstudios/pmpro-add-name-to-checkout/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:277:\"<h4>Changelog</h4><p>0.6.1 - 2023-01-31</p><ul>\n<li>BUG FIX/ENHANCEMENT: Improved logic for offsite gateways that use PHP Sessions. Fixes an issue where PayPal Express (and other offsite gateways) weren\'t saving the first name and last name correctly. (@mircobabini)</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:87:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-add-name-to-checkout.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:20:\"Add Name to Checkout\";}i:2;a:16:{s:4:\"Name\";s:48:\"Paid Memberships Pro - Add PayPal Express Add On\";s:5:\"Title\";s:48:\"Paid Memberships Pro - Add PayPal Express Add On\";s:9:\"PluginURI\";s:84:\"https://www.paidmembershipspro.com/add-ons/pmpro-add-paypal-express-option-checkout/\";s:4:\"Slug\";s:24:\"pmpro-add-paypal-express\";s:6:\"plugin\";s:53:\"pmpro-add-paypal-express/pmpro-add-paypal-express.php\";s:7:\"Version\";s:2:\".6\";s:11:\"Description\";s:49:\"Add PayPal Express as a Second Option at Checkout\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:82:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-add-paypal-express.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:18:\"Add PayPal Express\";}i:3;a:16:{s:4:\"Name\";s:37:\"Paid Memberships Pro - Addon Packages\";s:5:\"Title\";s:37:\"Paid Memberships Pro - Addon Packages\";s:9:\"PluginURI\";s:82:\"https://www.paidmembershipspro.com/add-ons/pmpro-purchase-access-to-a-single-page/\";s:4:\"Slug\";s:20:\"pmpro-addon-packages\";s:6:\"plugin\";s:45:\"pmpro-addon-packages/pmpro-addon-packages.php\";s:7:\"Version\";s:3:\"0.8\";s:11:\"Description\";s:95:\"Sell members-only access to individual pages or posts, or sell a la carte items for a flat fee.\";s:12:\"Installation\";s:280:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-addon-packages</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit a post or page to set a price for it.</li>\n</ol>\";s:3:\"FAQ\";s:810:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-addon-packages/issues\">https://github.com/strangerstudios/pmpro-addon-packages/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\n<p>Please Note: This plugin is meant as a temporary solution. Most updates and fixes will be reserved for when this functionality is built into Paid Memberships Pro. We may not fix the pmpro-addon-packages plugin itself unless it is critical.</p>\";s:9:\"Changelog\";s:223:\"<h4>Changelog</h4><p>0.8</p><ul>\n<li>BUG FIX/ENHANCEMENT: Better handling of cases where an addon package post has been trashed, deleted, or set back to draft status.</li>\n<li>ENHANCEMENT: Ready for localization.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:77:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-addon-packages.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:14:\"Addon Packages\";}i:4;a:16:{s:4:\"Name\";s:53:\"Paid Memberships Pro - Address For Free Levels Add On\";s:5:\"Title\";s:53:\"Paid Memberships Pro - Address For Free Levels Add On\";s:9:\"PluginURI\";s:92:\"https://www.paidmembershipspro.com/add-ons/capture-name-address-free-levels-offsite-gateway/\";s:4:\"Slug\";s:29:\"pmpro-address-for-free-levels\";s:6:\"plugin\";s:63:\"pmpro-address-for-free-levels/pmpro-address-for-free-levels.php\";s:7:\"Version\";s:3:\"0.5\";s:11:\"Description\";s:66:\"Show address fields for free levels also with Paid Memberships Pro\";s:12:\"Installation\";s:237:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-address-for-free-levels</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:830:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-address-for-free-levels/issues\">https://github.com/strangerstudios/pmpro-address-for-free-levels/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\n<p>Please Note: This plugin is meant as a temporary solution. Most updates and fixes will be reserved for when this functionality is built into Paid Memberships Pro. We may not fix the pmpro-addon-packages plugin itself unless it is critical.</p>\";s:9:\"Changelog\";s:363:\"<h4>Changelog</h4><p>0.5 - 2021-08-03</p><ul>\n<li>ENHANCEMENT: Strings wrapped for localization.</li>\n<li>BUG FIX/ENHANCEMENT: Fixed issue where the \"Billing\" label in the heading wasn\'t being hidden properly for free levels.</li>\n<li>BUG FIX: Fixed issues with session handling when using PayPal Express/etc. Fields were not being saved on some sites.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:86:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-address-for-free-levels.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:23:\"Address For Free Levels\";}i:5;a:16:{s:4:\"Name\";s:60:\"Paid Memberships Pro - Advanced Levels Page Shortcode Add On\";s:5:\"Title\";s:60:\"Paid Memberships Pro - Advanced Levels Page Shortcode Add On\";s:9:\"PluginURI\";s:75:\"https://www.paidmembershipspro.com/add-ons/pmpro-advanced-levels-shortcode/\";s:4:\"Slug\";s:31:\"pmpro-advanced-levels-shortcode\";s:6:\"plugin\";s:67:\"pmpro-advanced-levels-shortcode/pmpro-advanced-levels-shortcode.php\";s:7:\"Version\";s:5:\"0.2.5\";s:11:\"Description\";s:105:\"An enhanced shortcode for customizing the display of your Membership Levels Page for Paid Memberships Pro\";s:12:\"Installation\";s:829:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-advanced-levels</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Replace the [pmpro_levels] shortcode on your site with a [pmpro_advanced_levels] one.</li>\n</ol>\n<p>Here is an example of the pmpro_advanced_levels shortcode with all attributes.</p>\n<p>[pmpro_advanced_levels template=\"genesis\" levels=\"1,2,3\" layout=\"table\" hightlight=\"2\" description=\"false\" checkout_button=\"Register Now\"]</p>\n<p>For more information, see our blog post here:\n<a href=\"http://www.paidmembershipspro.com/2015/02/new-plugin-with-advanced-options-for-membership-levels-page-display/\">http://www.paidmembershipspro.com/2015/02/new-plugin-with-advanced-options-for-membership-levels-page-display/</a></p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:92:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-advanced-levels-shortcode.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:30:\"Advanced Levels Page Shortcode\";}i:6;a:16:{s:4:\"Name\";s:40:\"Paid Memberships Pro - Affiliates Add On\";s:5:\"Title\";s:40:\"Paid Memberships Pro - Affiliates Add On\";s:9:\"PluginURI\";s:80:\"https://www.paidmembershipspro.com/add-ons/pmpro-lightweight-affiliate-tracking/\";s:4:\"Slug\";s:16:\"pmpro-affiliates\";s:6:\"plugin\";s:37:\"pmpro-affiliates/pmpro-affiliates.php\";s:7:\"Version\";s:3:\"0.6\";s:11:\"Description\";s:82:\"Create affiliate accounts with unique referrer URLs to track membership checkouts.\";s:12:\"Installation\";s:741:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-affiliates</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Manage affiliates through the \"affiliates\" admin page added under Memberships.</li>\n<li>Affiliate URLs will look like <a href=\"http://site.com/?pa=AFFILIATECODE\">http://site.com/?pa=AFFILIATECODE</a></li>\n<li>You can add a \"subid\" to the URL on the fly for more granular tracking <a href=\"http://site.com/?pa=AFFILIATECODE&amp;subid=TEST1\">http://site.com/?pa=AFFILIATECODE&amp;subid=TEST1</a></li>\n<li>Create a page with the [pmpro_affiliates_report] shortcode and direct your affiliate users to that page.</li>\n</ol>\";s:3:\"FAQ\";s:555:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-affiliates/issues\">https://github.com/strangerstudios/pmpro-affiliates/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:1190:\"<h4>Changelog</h4><p>0.6 -2023-01-10</p><ul>\n<li>SECURITY: General improvements to sanitization and escaping of strings and SQL queries.</li>\n<li>ENHANCEMENT: Added ability to track commission rate and mark affiliate commission/orders as paid or reset them to unpaid. Defaults to 0% to keep backwards compatibility.</li>\n<li>ENHANCEMENT: Added \"PMPro Affiliates Report\" block.</li>\n<li>ENHANCEMENT: Improved frontend affiliate report to be responsive for mobile devices.</li>\n<li>ENHANCEMENT: Added the ability to search for affiliates based on the affiliate name or email within the admin area.</li>\n<li>ENHANCEMENT: General improvements to UI/UX of the affiliates admin area. Added various links to navigate between affiliate and user information more easily.</li>\n<li>ENHANCEMENT: Added autocomplete username functionality when creating an affiliate.</li>\n<li>ENHANCEMENT: Improved logic to figure out affiliate orders during checkout (Only loads relevant code on the checkout page).</li>\n<li>ENHANCEMENT: Added filter \'pmpro_affiliates_autocomplete_user_search_limit\' to adjust the number of users returned in the autocomplete search when adding an affiliate. Defaults to 25.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:77:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-affiliates.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:10:\"Affiliates\";}i:7;a:16:{s:4:\"Name\";s:42:\"Paid Memberships Pro - Akismet Integration\";s:5:\"Title\";s:42:\"Paid Memberships Pro - Akismet Integration\";s:9:\"PluginURI\";s:57:\"https://www.paidmembershipspro.com/add-ons/pmpro-akismet/\";s:4:\"Slug\";s:13:\"pmpro-akismet\";s:6:\"plugin\";s:31:\"pmpro-akismet/pmpro-akismet.php\";s:7:\"Version\";s:5:\"1.0.1\";s:11:\"Description\";s:86:\"Protect your membership site from checkout spam with Akismet and Paid Memberships Pro.\";s:12:\"Installation\";s:1545:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> and <a href=\"https://wordpress.org/plugins/akismet/\">Akismet</a> installed and activated on your site.</p>\n<h3>Install PMPro Akismet from within WordPress</h3>\n<ol>\n<li>Make sure Paid Memberships Pro is active.</li>\n<li>Visit Memberships &gt; Add Ons</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - Akismet Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro Akismet Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-akismet</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - Akismet Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: How to Use</h3>\n<p>This plugin relies on the settings you have configured within the main Akismet plugin.</p>\n<p>Navigate to Settings &gt; Akismet Anti-Spam to configure your general Akismet settings.</p>\n<p>PMPro Akismet will automatically detect spam at checkout and prevent submissions if they are considered spam. If you have enabled the setting to \"Display a privacy notice under your comment forms,\" this message will also display on your membership checkout page.</p>\n<p>View full documentation at: <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-akismet/\">https://www.paidmembershipspro.com/add-ons/pmpro-akismet/</a>.</p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:514:\"<h4>Changelog</h4><p>1.0.1 - 2023-03-30</p><ul>\n<li>ENHANCEMENT: Now calling pmpro_track_spam() when spam data is detected. If the PMPro Spam Protection feature is enabled, this will block users from the same IP from submitting checkouts after a certain number of failures.</li>\n<li>ENHANCEMENT/BUG FIX: Bailing on the registration checks early if there is already another issue with checkout. This helps with performance and won\'t e.g. check for spam if the user submitted the form with missing fields.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:70:\"http://license.paidmembershipspro.com/downloads/free/pmpro-akismet.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:19:\"Akismet Integration\";}i:8;a:16:{s:4:\"Name\";s:39:\"Paid Memberships Pro - Approvals Add On\";s:5:\"Title\";s:39:\"Paid Memberships Pro - Approvals Add On\";s:9:\"PluginURI\";s:71:\"https://www.paidmembershipspro.com/add-ons/approval-process-membership/\";s:4:\"Slug\";s:15:\"pmpro-approvals\";s:6:\"plugin\";s:35:\"pmpro-approvals/pmpro-approvals.php\";s:7:\"Version\";s:3:\"1.5\";s:11:\"Description\";s:75:\"Grants administrators the ability to approve/deny memberships after signup.\";s:12:\"Installation\";s:1053:\"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-approvals/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>To set a level\'s approval requirements, edit your membership level and adjust the settings under \"Approval Settings\".</li>\n<li>To process membership approvals, navigate to the Approvals Dashboard under Memberships &gt; Approvals.</li>\n<li>To customize the emails related to this plugin, navigate to Memberships &gt; Settings &gt; Email Templates in the WordPress admin.</li>\n</ol>\n<p>View full documentation at: <a href=\"https://www.paidmembershipspro.com/add-ons/approval-process-membership/\">https://www.paidmembershipspro.com/add-ons/approval-process-membership/</a></p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:519:\"<h4>Changelog</h4><p>1.5 - 2022-10-06</p><ul>\n<li>ENHANCEMENT: Added support for Multiple Memberships Per User, allowing individual approval for each level ID a user may hold.</li>\n<li>ENHANCEMENT: Improved logic for the Approval Counter to increase accuracy.</li>\n<li>ENHANCEMENT: Added support for member directory filtering within the PMPro BuddyPress &amp; BuddyBoss Add On.</li>\n<li>BUG FIX: Fixed an issue where free checkouts would cause a warning that level ID\'s are missing on the confirmation page.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:72:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-approvals.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:9:\"Approvals\";}i:9;a:16:{s:4:\"Name\";s:44:\"Paid Memberships Pro - Auto-Renewal Checkbox\";s:5:\"Title\";s:44:\"Paid Memberships Pro - Auto-Renewal Checkbox\";s:9:\"PluginURI\";s:85:\"https://www.paidmembershipspro.com/add-ons/auto-renewal-checkbox-membership-checkout/\";s:4:\"Slug\";s:27:\"pmpro-auto-renewal-checkbox\";s:6:\"plugin\";s:59:\"pmpro-auto-renewal-checkbox/pmpro-auto-renewal-checkbox.php\";s:7:\"Version\";s:5:\"0.3.0\";s:11:\"Description\";s:55:\"Make auto-renewal optional at checkout with a checkbox.\";s:12:\"Installation\";s:307:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-auto-renewal-checkbox</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit your membership levels and set the \"Auto Renewal\" options for each level.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:675:\"<h4>Changelog</h4><p>0.3.0 - 2021-09-08</p><ul>\n<li>BUG FIX/ENHANCEMENT: Updated the \"cancel on next payment date\" logic to work how the latest version of the CONPD plugin works. Will also use the CONPD plugin instead of the included code, if the CONPD add on is active. The CONPD add on will be merged into PMPro core sometime in the future.</li>\n<li>BUG FIX: Fixed some localization issues.</li>\n<li>BUG FIX: When a discount code is used, this plugin will NOT try to adjust the level at checkout to be recurring or not. Instead, it uses the settings from the discount code. We fixed an issue where the plugin sometimes DID try to adjust the level in these cases.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:84:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-auto-renewal-checkbox.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Auto-Renewal Checkbox\";}i:10;a:16:{s:4:\"Name\";s:36:\"Paid Memberships Pro - AvaTax Add On\";s:5:\"Title\";s:36:\"Paid Memberships Pro - AvaTax Add On\";s:9:\"PluginURI\";s:69:\"https://www.paidmembershipspro.com/add-ons/avalara-avatax-integration\";s:4:\"Slug\";s:12:\"pmpro-avatax\";s:6:\"plugin\";s:29:\"pmpro-avatax/pmpro-avatax.php\";s:7:\"Version\";s:3:\"0.1\";s:11:\"Description\";s:74:\"Integrate with Avalara AvaTax for automated sales and use tax calculation.\";s:12:\"Installation\";s:889:\"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n<li>You must have a <a href=\"https://www.avalara.com\">subscription with Avalara</a> to use this service.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-avatax/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Settings</p><ol>\n<li>Navigate to Memberships &gt; AvaTax in the WordPress admin.</li>\n<li>Complete the fields in the \"Credentials\" section to connect your membership site to your Avalara account.</li>\n<li>Complete the fields with your \"Company\" information and configure additional options.</li>\n<li>Save settings.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:61:\"<h4>Changelog</h4><p>0.1</p><ul>\n<li>First commit.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:69:\"http://license.paidmembershipspro.com/downloads/free/pmpro-avatax.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:6:\"AvaTax\";}i:11;a:16:{s:4:\"Name\";s:36:\"Paid Memberships Pro - AWeber Add On\";s:5:\"Title\";s:36:\"Paid Memberships Pro - AWeber Add On\";s:9:\"PluginURI\";s:68:\"https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/\";s:4:\"Slug\";s:12:\"pmpro-aweber\";s:6:\"plugin\";s:29:\"pmpro-aweber/pmpro-aweber.php\";s:7:\"Version\";s:5:\"1.3.3\";s:11:\"Description\";s:70:\"Add users and members to AWeber lists based on their membership level.\";s:12:\"Installation\";s:1319:\"<p>Installation</p><p>This plugin works with and without Paid Memberships Pro installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-aweber</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Settings &gt; PMPro Aweber to proceed with setup.</li>\n</ol><p>Configuration and Settings</p><p><strong>Authorize your app with AWeber:</strong> Your Authorization Code will be provided once the app is authorized with your AWeber account. Navigate to Settings &gt; PMPro AWeber in the WordPress dashboard to authorize your app with AWeber.</p>\n<p>After entering your Authorization Code, continue with the setup by assigning All User Lists, Membership Level Lists, and review the additional settings.</p>\n<p>For full documentation on all settings, please visit the <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/\">AWeber Integration Add On documentation page at Paid Memberships Pro</a>. </p>\n<p>Filter hooks are available for developers that need to customize specific aspects of the integration. <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/#hooks\">Please explore the plugin\'s action and filter hooks here</a>.</p>\";s:3:\"FAQ\";s:547:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-aweber/issues\">https://github.com/strangerstudios/pmpro-aweber/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:162:\"<h4>Changelog</h4><p>1.3.3 - 2023-06-28</p><ul>\n<li>BUG FIX: Fixes a fatal error when trying to connect to Aweber on a local environment. (@JarrydLong)</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:55:\"https://downloads.wordpress.org/plugin/pmpro-aweber.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:6:\"AWeber\";}i:12;a:16:{s:4:\"Name\";s:18:\"Basic User Avatars\";s:5:\"Title\";s:18:\"Basic User Avatars\";s:9:\"PluginURI\";s:49:\"https://wordpress.org/plugins/basic-user-avatars/\";s:4:\"Slug\";s:18:\"basic-user-avatars\";s:6:\"plugin\";s:41:\"basic-user-avatars/basic-user-avatars.php\";s:7:\"Version\";s:5:\"1.0.6\";s:11:\"Description\";s:111:\"Add an avatar upload field on frontend pages and Edit Profile screen so users can add a custom profile picture.\";s:12:\"Installation\";s:1109:\"<p>Installation</p><ol>\n<li>Upload <code>basic-user-avatars</code> to your <code>/wp-content/plugins/</code> directory or download through the Plugins page.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>If you only want users with file upload capabilities to upload avatars, check the applicable option under Settings &gt; Discussion.</li>\n<li>Navigate to Users &gt; Edit User to upload a custom avatar for your users.</li>\n<li>Add the <code>[basic-user-avatars]</code> shortcode to a page in your WordPress site to allow front-end avatar upload for your users.</li>\n</ol>\n<p>bbPress support is added automatically if bbPress is activated.</p>\n<p><strong><a href=\"https://github.com/strangerstudios/basic-user-avatars/\">This plugin is on GitHub</a></strong> and pull requests are welcome. If possible please report issues through Github.</p>\n<p>Note: This plugin is a fork of Simple Local Avatars v1.3.1 by Jake Goldman and 10up. Check out <a href=\"http://wordpress.org/plugins/simple-local-avatars\">Simple Local Avatars</a> to compare their latest release to this plugin.</p>\";s:3:\"FAQ\";s:578:\"<p>Frequently Asked Questions</p><p>I\'m still having problems</p><p>While this plugin has been tested with common server setups, some enviroments could cause an issue.</p>\n<p>If you are having a problem deactivate all plugins other than this one and then switch your theme to TwentyTweleve (or similar). If things work, then the issue is with a 3rd party theme or plugin.</p>\n<p>If things are still not functioning properly then proceed to reporting an issue. The ideal method is via <a href=\"https://github.com/strangerstudios/basic-user-avatars/issues/\">GitHub issues</a>.</p>\";s:9:\"Changelog\";s:706:\"<h4>Changelog</h4><p>1.0.6</p><ul>\n<li>ENHANCEMENT: Added translation for German locale. Thanks @olpo24</li>\n<li>ENHANCEMENT: Added translation for Italian locale. Thanks @domegang</li>\n<li>ENHANCEMENT: Now filtering the get_avatar_data WordPress hook to allow more flexibility in customizing avatars via other filters.</li>\n<li>ENHANCEMENT: Added filter <code>basic_user_avatar_data</code> to allow filtering on the avatar data that we are overriding.</li>\n<li>BUG FIX: Fixed issue with saving the Discussion setting limiting avatar upload to users with file upload capabilities.</li>\n<li>BUG FIX: Fixed an issue when user display names were interfering and causing 404 errors. Thanks @semanio.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:32:\"https://www.strangerstudios.com/\";s:8:\"Download\";s:61:\"https://downloads.wordpress.org/plugin/basic-user-avatars.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:18:\"Basic User Avatars\";}i:13;a:16:{s:4:\"Name\";s:37:\"Paid Memberships Pro - bbPress Add On\";s:5:\"Title\";s:37:\"Paid Memberships Pro - bbPress Add On\";s:9:\"PluginURI\";s:57:\"https://www.paidmembershipspro.com/add-ons/pmpro-bbpress/\";s:4:\"Slug\";s:13:\"pmpro-bbpress\";s:6:\"plugin\";s:31:\"pmpro-bbpress/pmpro-bbpress.php\";s:7:\"Version\";s:5:\"1.7.3\";s:11:\"Description\";s:104:\"Restrict access to bbPress for free or premium members by integrating bbPress with Paid Memberships Pro.\";s:12:\"Installation\";s:2408:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> and <a href=\"https://wordpress.org/plugins/bbpress/\">bbPress</a> installed and activated on your site.</p>\n<h3>Install PMPro bbPress from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro bbPress\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - bbPress Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro bbPress Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-bbpress</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - bbPress Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Create a Private Forum</h3>\n<ol>\n<li>Navigate to Forums &gt; Edit Forum to restrict access to the forum and make it private.</li>\n<li>Or, create a new Forum under Forums &gt; Add New.</li>\n<li>In the right column \"Settings\" panel, locate the \"Require Membership\" section.</li>\n<li>Check the box for one or more membership level that can access this forum.</li>\n<li>Save your changes by clicking the \"Update\" button (or \"Publish\" if you are creating a new forum).</li>\n<li>Further settings can be found on the Settings &gt; Forums page of your admin dashboard.</li>\n</ol>\n<h3>Shortcode for Member Activity</h3>\n<p>The bbPress Integration for Paid Memberships Pro includes one shortcode to display a member\'s activity (topics or replies created).</p><p>Sample shortcode usage:</p><p><code>[bbp-user-activity activity_type=\"topic\" show_date=\"true\" title=\"My Recent Topics\"]</code></p><p>Shortcode attributes include:</p><ul>\n<li>activity_type: Accepts \'topic\' or \'reply\'. Default is \'topic\'</li>\n<li>bbp_user_id: Accepts any user ID. Omit this attribute to load the current user\'s entries. Default is the <code>current_user-&gt;ID</code>.</li>\n<li>count: The number of entries to show. Default is \'5\'.</li>\n<li>show_date: Optionally show the entry date. Default is \'false\'.</li>\n<li>show_excerpt: Optionally show a 50-character excerpt of the entry. Default is \'false\'.</li>\n<li>title: An optional title for the shortcode output, wrapped in the h2 class=\"widgettitle\" format.</li>\n</ul>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:286:\"<h4>Changelog</h4><p>1.7.3 - 2021-08-13</p><ul>\n<li>BUG FIX: Fixed issue that was causing fatal errors when WP_Query didn\'t contain posts when other plugins were setting the query. Fixes an issue for Formidable Pro/Registrations and improves compatibility with other plugins.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:56:\"https://downloads.wordpress.org/plugin/pmpro-bbpress.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:7:\"bbPress\";}i:14;a:16:{s:4:\"Name\";s:50:\"Paid Memberships Pro - Better Logins Report Add On\";s:5:\"Title\";s:50:\"Paid Memberships Pro - Better Logins Report Add On\";s:9:\"PluginURI\";s:64:\"http://www.paidmembershipspro.com/wp/pmpro-better-logins-report/\";s:4:\"Slug\";s:26:\"pmpro-better-logins-report\";s:6:\"plugin\";s:57:\"pmpro-better-logins-report/pmpro-better-logins-report.php\";s:7:\"Version\";s:6:\".2.3.2\";s:11:\"Description\";s:66:\"Adds login, view, and visit stats for \"This Week\" and \"This Year\".\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:84:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-better-logins-report.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:20:\"Better Logins Report\";}i:15;a:16:{s:4:\"Name\";s:52:\"Paid Memberships Pro - BuddyPress & BuddyBoss Add On\";s:5:\"Title\";s:52:\"Paid Memberships Pro - BuddyPress & BuddyBoss Add On\";s:9:\"PluginURI\";s:65:\"https://www.paidmembershipspro.com/add-ons/buddypress-integration\";s:4:\"Slug\";s:16:\"pmpro-buddypress\";s:6:\"plugin\";s:37:\"pmpro-buddypress/pmpro-buddypress.php\";s:7:\"Version\";s:5:\"1.3.1\";s:11:\"Description\";s:84:\"Restrict access to your BuddyPress or BuddyBoss Community using Paid Memberships Pro\";s:12:\"Installation\";s:4583:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> and <a href=\"https://wordpress.org/plugins/buddypress/\">BuddyPress</a> or <a href=\"https://www.paidmembershipspro.com/buddyboss-membership-plugin/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress\">BuddyBoss</a> installed and activated on your site.</p>\n<h3>Install PMPro BuddyPress from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro BuddyPress\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - BuddyPress Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro BuddyPress Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-buddypress</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - BuddyPress Integration\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Configure Plugin Settings</h3>\n<p>There are four primary settings areas in this plugin.</p><ol>\n<li>Select Your Preferred Registration Process</li>\n</ol><p>This plugin allows you to use the BuddyPress or BuddyBoss user registration process (in place of the standard Paid Memberships Pro membership checkout process).</p>\n<ol>\n<li>Navigate to Memberships &gt; PMPro BuddyPress in the WordPress admin.</li>\n<li>Change the \"Registration Page\" setting to \"Use BuddyPress Registration Page\".</li>\n<li>Save Settings.</li>\n</ol>\n<p>Note: If your membership is not free, you must use the Paid Memberships Pro membership checkout process. If you have a free community and want to allow users to register through BuddyPress or BuddyBoss, you must adjust this setting.</p>\n<p>If you\'d like members that register through the BuddyPress or BuddyBoss system to also be given a membership level, check out this guide on <a href=\"https://www.paidmembershipspro.com/apply-a-buddypress-member-type-on-membership-checkout-or-level-change/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress\">setting a default level for all user registrations in WordPress</a>.</p><ol start=\"2\">\n<li>Assign the \"Access Restricted\" Page</li>\n</ol><p>Navigate to Memberships &gt; Settings &gt; Pages to create or edit the \"Access Restricted\" page.</p>\n<p>This is the page that visitors and users are redirected to if they cannot access restricted BuddyPress or BuddyBoss features.</p><ol start=\"3\">\n<li>Configure Membership Level Settings</li>\n</ol><p>Navigate to Memberships &gt; Settings &gt; Membership Levels and locate the \"BuddyPress Restrictions\" section.</p>\n<p>From this section you can adjust settings for how you \"unlock BuddyPress\" for members of this level, including:</p>\n<ul>\n<li>Group Creation</li>\n<li>Single Group Viewing</li>\n<li>Groups Page Viewing</li>\n<li>Joining Groups</li>\n<li>Public Messaging</li>\n<li>Private Messaging</li>\n<li>Send Friend Requests</li>\n<li>Include in Member Directory</li>\n</ul>\n<p>Next, adjust the \"BuddyPress Group Membership\" settings to add or invite members of this level to your existing BuddyPress Groups.</p>\n<p>If you want to adjust BuddyPress Member Types, you must first create the types through custom code. <a href=\"https://www.paidmembershipspro.com/apply-a-buddypress-member-type-on-membership-checkout-or-level-change/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress\">This post explains how to add Member Types to BuddyPress</a>.</p>\n<p><a href=\"https://www.paidmembershipspro.com/add-ons/buddypress-integration/#members?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress\">Read our full documentation on Membership Level Settings for your BuddyPress or BuddyBoss community here</a>.</p><ol start=\"4\">\n<li>Configure Settings for Logged in Non Members</li>\n</ol><p>Some of your WordPress users may not have a membership level in Paid Memberships Pro. This plugin allows you to set how BuddyPress should be locked down for these users without a membership level.</p>\n<p>Navigate to Memberships &gt; Settings &gt; PMPro BuddyPress and locate the \"Non-member User Settings\" section.</p>\n<p><a href=\"https://www.paidmembershipspro.com/add-ons/buddypress-integration/#non_member_user?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress\">Read our full documentation on Non-Member Users in BuddyPress or BuddyBoss here</a>.</p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:173:\"<h4>Changelog</h4><p>1.3.2 - 2022-09-13</p><ul>\n<li>BUG FIX: Fixed an issue from v1.3 that was causing the member directory to constantly be locked in most cases.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:59:\"https://downloads.wordpress.org/plugin/pmpro-buddypress.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:22:\"BuddyPress & BuddyBoss\";}i:16;a:16:{s:4:\"Name\";s:50:\"Paid Memberships Pro - Cancel on Next Payment Date\";s:5:\"Title\";s:50:\"Paid Memberships Pro - Cancel on Next Payment Date\";s:9:\"PluginURI\";s:70:\"https://www.paidmembershipspro.com/add-ons/cancel-on-next-payment-date\";s:4:\"Slug\";s:33:\"pmpro-cancel-on-next-payment-date\";s:6:\"plugin\";s:71:\"pmpro-cancel-on-next-payment-date/pmpro-cancel-on-next-payment-date.php\";s:7:\"Version\";s:5:\"0.5.1\";s:11:\"Description\";s:105:\"Change membership cancellation to set expiration date for next payment instead of cancelling immediately.\";s:12:\"Installation\";s:301:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-cancel-on-next-payment-date</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That\'s it. This plugin has no additional settings.</li>\n</ol>\";s:3:\"FAQ\";s:343:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-cancel-on-next-payment-date/issues\">https://github.com/strangerstudios/pmpro-cancel-on-next-payment-date/issues</a></p>\";s:9:\"Changelog\";s:195:\"<h4>Changelog</h4><p>0.5.1 - 2022-08-22</p><ul>\n<li>ENHANCEMENT: Internationalization for the date in the cancellation text string. (This was accidentally left out of the last update.)</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:90:\"http://license.paidmembershipspro.com/downloads/free/pmpro-cancel-on-next-payment-date.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:27:\"Cancel on Next Payment Date\";}i:17;a:16:{s:4:\"Name\";s:37:\"Paid Memberships Pro - CCBill Gateway\";s:5:\"Title\";s:37:\"Paid Memberships Pro - CCBill Gateway\";s:9:\"PluginURI\";s:49:\"https://www.paidmembershipspro.com/add-ons/ccbill\";s:4:\"Slug\";s:12:\"pmpro-ccbill\";s:6:\"plugin\";s:29:\"pmpro-ccbill/pmpro-ccbill.php\";s:7:\"Version\";s:3:\"0.3\";s:11:\"Description\";s:36:\"PMPro Gateway integration for CCBill\";s:12:\"Installation\";s:533:\"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-ccbill</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\n<p>Navigate to Memberships &gt; Settings &gt; Payment Gateways &amp; SSL and select the CCBill payment gateway. You will then need to fill out the required account credentials to connect your website to the payment gateway.</p>\";s:3:\"FAQ\";s:493:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-ccbill/issues\">https://github.com/strangerstudios/pmpro-ccbill/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:307:\"<h4>Changelog</h4><p>0.3 - 2023-05-05</p><ul>\n<li>BUG FIX: Fixed issue where cancellations in PMPro were not being sent to CCBill.</li>\n<li>BUG FIX: Fixed issue where \"failed cancellation\" emails may be incorrectly sent.</li>\n<li>BUG FIX: Handling undefined 