i>\n<li>Or, download the latest version of the plugin, then go to Plugins &gt; Add New and click the \"Upload Plugin\" button to upload your .zip file.</li>\n<li>Activate the plugin.</li>\n</ol><p>Complete the Initial Plugin Setup</p><p>Go to Memberships &gt; Discord Settings in the WordPress admin to begin setup. Our <a href=\"https://youtu.be/v7lxB_Bvlv4\">Initial Setup Tutorial Video </a> will show you how to configure</p><p>More Installation and Setup Documentation</p><ul>\n<li><a href=\"https://youtu.be/v7lxB_Bvlv4\">Installation Video</a></li>\n<li><a href=\"https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/\">Installation Docs</a></li>\n</ul>\";s:3:\"FAQ\";s:471:\"<p>Frequently Asked Questions</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href=\"https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/\">our support site at https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:59:\"ExpressTech Software Solutions Pvt. Ltd., Strangers Studios\";s:9:\"AuthorURI\";s:36:\"https://www.expresstechsoftwares.com\";s:8:\"Download\";s:63:\"https://downloads.wordpress.org/plugin/pmpro-discord-add-on.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:39:\"Connect Paid Memberships Pro to Discord\";}i:20;a:16:{s:4:\"Name\";s:46:\"Paid Memberships Pro - Constant Contact Add On\";s:5:\"Title\";s:46:\"Paid Memberships Pro - Constant Contact Add On\";s:9:\"PluginURI\";s:56:\"http://www.paidmembershipspro.com/pmpro-constantcontact/\";s:4:\"Slug\";s:22:\"pmpro-constant-contact\";s:6:\"plugin\";s:49:\"pmpro-constant-contact/pmpro-constant-contact.php\";s:7:\"Version\";s:5:\"1.0.2\";s:11:\"Description\";s:66:\"Sync your WordPress users and members with Constant Contact lists.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:65:\"https://downloads.wordpress.org/plugin/pmpro-constant-contact.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:16:\"Constant Contact\";}i:21;a:16:{s:4:\"Name\";s:45:\"Paid Memberships Pro - ConvertKit Integration\";s:5:\"Title\";s:45:\"Paid Memberships Pro - ConvertKit Integration\";s:9:\"PluginURI\";s:53:\"https://www.paidmembershipspro.com/add-ons/convertkit\";s:4:\"Slug\";s:35:\"convertkit-for-paid-memberships-pro\";s:6:\"plugin\";s:75:\"convertkit-for-paid-memberships-pro/convertkit-for-paid-memberships-pro.php\";s:7:\"Version\";s:5:\"1.1.0\";s:11:\"Description\";s:66:\"Subscribe and tag your Paid Memberships Pro members in ConvertKit.\";s:12:\"Installation\";s:865:\"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Go to Plugins &gt; Add New to find and install ConvertKit Paid Memberships Pro Integration.</li>\n<li>Or, download the latest version of the plugin, then go to Plugins &gt; Add New and click the \"Upload Plugin\" button to upload your .zip file.</li>\n<li>Activate the plugin.</li>\n</ol><p>Complete the ConvertKit Integration Setup</p><p>Go to Settings &gt; PMPro ConvertKit in the WordPress admin to begin setup.</p>\n<ol>\n<li>Enter your ConvertKit API key, which you can find <a href=\"https://app.convertkit.com/account/edit\">here</a>.</li>\n<li>To add purchase data for subscribers, enter your ConvertKit Secret API key.</li>\n<li>Save your settings.</li>\n<li>Then, adjust the dropdown fields to select a tag for subscribers who sign up for each Membership Level.</li>\n<li>Save your settings.</li>\n</ol>\";s:3:\"FAQ\";s:155:\"<p>Frequently Asked Questions</p><p>Does this plugin require a paid service?</p><p>Yes, for it to work you must first have an account on ConvertKit.com</p>\";s:9:\"Changelog\";s:857:\"<h4>Changelog</h4><p>1.1 - 2021-06-21</p><ul>\n<li>FEATURE: Updated opt-in settings. You can edit the label shown on the opt-in message at checkout.</li>\n<li>FEATURE: Added purchase tracking for each level in ConvertKit.</li>\n<li>ENHANCEMENT: Added assets for GitHub and WordPress.org.</li>\n<li>ENHANCEMENT: Added field to capture API Secret Key.</li>\n<li>ENHANCEMENT: Added Purchases tracking for new membership checkouts.</li>\n<li>ENHANCEMENT: Added filter <code>pmpro_convertkit_change_membership_level_remove_tags</code> to allow optionally removing tags on level change when the previous level is passed to the pmpro_after_change_membership_level function.</li>\n<li>BUG FIX: Email addresses and names are now properly URL encoded when passed to ConvertKit.</li>\n<li>REFACTOR: Refactored API method for retrieving tags and tagging subscribers.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:78:\"https://downloads.wordpress.org/plugin/convertkit-for-paid-memberships-pro.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:22:\"ConvertKit Integration\";}i:22;a:16:{s:4:\"Name\";s:52:\"Paid Memberships Pro - Courses for Membership Add On\";s:5:\"Title\";s:52:\"Paid Memberships Pro - Courses for Membership Add On\";s:9:\"PluginURI\";s:73:\"https://www.paidmembershipspro.com/add-ons/pmpro-courses-lms-integration/\";s:4:\"Slug\";s:13:\"pmpro-courses\";s:6:\"plugin\";s:31:\"pmpro-courses/pmpro-courses.php\";s:7:\"Version\";s:5:\"1.2.3\";s:11:\"Description\";s:89:\"Create courses and lessons for members. Integrates LMS plugins with Paid Memberships Pro.\";s:12:\"Installation\";s:2216:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> installed and activated on your site.</p>\n<h3>Install PMPro Courses from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro Courses\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - Courses for Membership\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro Courses Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-courses</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - Courses for Membership\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Configure Course Modules</h3>\n<p>Navigate to Memberships &gt; Courses in the WordPress admin to configure modules.</p>\n<p>The Courses settings page controls which modules are active in your membership site. In most cases, you will only need to have one module active at a time. Navigate to Memberships &gt; Courses to choose from the following settings:</p>\n<ol>\n<li>Default Module: Use the built-in course and lesson custom post types to build a basic e-learning component in your WordPress membership site.</li>\n<li>LearnDash: Enable the LearnDash module to enable course protection by membership level for your courses in the LearnDash LMS.</li>\n<li>LifterLMS: Enable the LifterLMS module to enable course protection by membership level for your courses in LifterLMS.</li>\n</ol>\n<p>Note: This Add On does not include any update scripts to manage enrollment for existing members. For the LearnDash and LifterLMS modules, all members who have an existing membership level will not be automatically enrolled in courses. Course protection and enrollment is hooked in the level change event: only new members or members that cancel or change their level will be updated. You must manually add and remove current members from protected courses.</p>\n<p>The default (built-in) module does not rely on enrollment and will not require any update script.</p>\";s:3:\"FAQ\";s:543:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-courses/issues\">https://github.com/strangerstudios/pmpro-courses/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href=\"http://www.paidmembershipspro.com/\">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:801:\"<h4>Changelog</h4><p>1.2.3 - 2023-07-11</p>\n<ul>\n<li>BUG FIX: Fixed issue where rewrite slug prefix would default to pmpro_course sometimes. The slug prefix should always be course (or course-2/etc if there are other plugins using course already). Flushing the pretty permalink rewrite rules can fix issues.</li>\n</ul>\n<p>= 1.2.2 - 2023-06-30</p><ul>\n<li>BUG FIX/ENHANCEMENT: Added open to enable or disable the default module\'s Course CPT archive.</li>\n<li>BUG FIX: Fixed and issue with TutorLMS integration. Clicking Preview lesson button was causing redirect instead of actually preview the lesson.</li>\n<li>BUG FIX: Fixed an issue with default and LifterLMS modules enabled at the same time. LifterLMS courses were giving 404 errors due conflicts with default CPT and Lifter permalinks.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:56:\"https://downloads.wordpress.org/plugin/pmpro-courses.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:22:\"Courses for Membership\";}i:23;a:16:{s:4:\"Name\";s:52:\"Paid Memberships Pro - Custom Level Cost Text Add On\";s:5:\"Title\";s:52:\"Paid 