n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-download-monitor/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>After activation, navigate to \"Downloads\" to Edit or Add a New Download.</li>\n<li>Check the box for each level that can access this download in the \"Require Membership\" meta box (below the Publish box in the right sidebar). </li>\n<li>Save your changes by clicking the \"Update\" button (or \"Publish\" if you are creating a new download).</li>\n</ol>\n<p>When using the [download] shortcode you can optionally specify the appropriate \"pmpro\" template. Available templates include: \"pmpro\", \"pmpro_box\", \"pmpro_button\", \"pmpro_filename\", \"pmpro_title\".</p>\n<p>If you do not specify a template, the output of the [download] shortcode can be filtered for a non-member by using the filter: pmprodlm_shortcode_download_content_filter. This will alter the message shown to a visitor that is not logged in or a logged in user that doesn\'t meet membership requirements.</p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:152:\"<h4>Changelog</h4><p>.2.1</p><ul>\n<li>BUG FIX: Using the get_id() method to get the id of downloads now that the -&gt;id property is private.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:79:\"http://license.paidmembershipspro.com/downloads/free/pmpro-download-monitor.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:28:\"Download Monitor Integration\";}i:28;a:16:{s:4:\"Name\";s:48:\"Paid Memberships Pro - Email Confirmation Add On\";s:5:\"Title\";s:48:\"Paid Memberships Pro - Email Confirmation Add On\";s:9:\"PluginURI\";s:69:\"https://www.paidmembershipspro.com/add-ons/email-confirmation-add-on/\";s:4:\"S