<p>0.8.1 - 2020-06-04</p><ul>\n<li>BUG Fix: Fixed issue where !!membership_change!! may not show user\'s new membership level.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:79:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-email-templates.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:15:\"Email Templates\";}i:30;a:16:{s:4:\"Name\";s:36:\"Paid Memberships Pro - Events Add On\";s:5:\"Title\";s:36:\"Paid Memberships Pro - Events Add On\";s:9:\"PluginURI\";s:67:\"https://www.paidmembershipspro.com/add-ons/events-for-members-only/\";s:4:\"Slug\";s:12:\"pmpro-events\";s:6:\"plugin\";s:29:\"pmpro-events/pmpro-events.php\";s:7:\"Version\";s:3:\"1.4\";s:11:\"Description\";s:65:\"Offer Members-only events using PMPro and popular events plugins.\";s:12:\"Installation\";s:1923:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> installed and activated on your site.</p>\n<h3>Install PMPro Events from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro Events\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - Events\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro Events Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-events</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - Events\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Create Members-Only Events</h3>\n<p>Once the plugin is activated, it automatically detects which events module to load for your site. The included modules are:</p>\n<ul>\n<li><a href=\"https://wordpress.org/plugins/events-manager/\">Events Manager</a></li>\n<li><a href=\"https://wordpress.org/plugins/the-events-calendar/\">The Events Calendar</a></li>\n<li><a href=\"https://wordpress.org/plugins/sugar-calendar-lite/\">Sugar Calendar</a></li>\n<li><a href=\"https://wordpress.org/plugins/all-in-one-event-calendar/\">Timely All-in-One Events Calendar</a></li>\n</ul>\n<p>If you are not already using an events plugin, you must select one from this list to use the features of this integration plugin.</p>\n<ol>\n<li>Edit any event in your site to restrict access via the \"Require Membership\" meta box.</li>\n<li>Events are displayed or hidden from calendar (archive) view according to your settings under Memberships &gt; Settings &gt; Advanced Settings.</li>\n<li>Event excerpts are shown or hidden from non-members according to your settings under Memberships &gt; Settings &gt; Advanced Settings.</li>\n</ol>\";s:3:\"FAQ\";s:693:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-events/issues\">https://github.com/strangerstudios/pmpro-events/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href=\"https://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:321:\"<h4>Changelog</h4><p>1.4 - 2023-02-01</p><ul>\n<li>ENHANCEMENT: Support recurring events for The Events Calendar. It inherits the \'main\' event membership settings.</li>\n<li>BUG FIX: Resolve a database warning (unique alias warnings) for The Events Calendar in some instances when SQL queries run multiple times.</li>\n</ul>\";s:6: