rom-non-admins/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:78:\"<h4>Changelog</h4><p>1.0</p><ul>\n<li>Initial version of the plugin.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:31:\"https://www.strangerstudios.com\";s:8:\"Download\";s:73:\"https://downloads.wordpress.org/plugin/hide-admin-bar-from-non-admins.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:30:\"Hide Admin Bar From Non-admins\";}i:38;a:16:{s:4:\"Name\";s:45:\"Paid Memberships Pro - Holler Box Integration\";s:5:\"Title\";s:45:\"Paid Memberships Pro - Holler Box Integration\";s:9:\"PluginURI\";s:66:\"https://www.paidmembershipspro.com/add-ons/holler-box-integration/\";s:4:\"Slug\";s:15:\"pmpro-hollerbox\";s:6:\"plugin\";s:35:\"pmpro-hollerbox/pmpro-hollerbox.php\";s:7:\"Version\";s:4:\".1.1\";s:11:\"Description\";s:105:\"Integrates Paid Memberships Pro with the Holler Box plugin to display popups/banners by membership level.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:73:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-hollerbox.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:22:\"Holler Box Integration\";}i:39;a:16:{s:4:\"Name\";s:21:\"Import Users from CSV\";s:5:\"Title\";s:21:\"Import Users from CSV\";s:9:\"PluginURI\";s:58:\"http://wordpress.org/extend/plugins/import-users-from-csv/\";s:4:\"Slug\";s:21:\"import-users-from-csv\";s:6:\"plugin\";s:47:\"import-users-from-csv/import-users-from-csv.php\";s:7:\"Version\";s:5:\"1.0.0\";s:11:\"Description\";s:47:\"Import Users data and metadata from a csv file.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:13:\"Ulrich Sossou\";s:9:\"AuthorURI\";s:24:\"http://ulrichsossou.com/\";s:8:\"Download\";s:64:\"https://downloads.wordpress.org/plugin/import-users-from-csv.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Import Users from CSV\";}i:40;a:16:{s:4:\"Name\";s:51:\"Paid Memberships Pro - Import Users from CSV Add On\";s:5:\"Title\";s:51:\"Paid Memberships Pro - Import Users from CSV Add On\";s:9:\"PluginURI\";s:62:\"http://www.paidmembershipspro.com/pmpro-import-users-from-csv/\";s:4:\"Slug\";s:27:\"pmpro-import-users-from-csv\";s:6:\"plugin\";s:59:\"pmpro-import-users-from-csv/pmpro-import-users-from-csv.php\";s:7:\"Version\";s:3:\"0.4\";s:11:\"Description\";s:90:\"Add-on for the Import Users From CSV plugin to import PMPro and membership-related fields.\";s:12:\"Installation\";s:1864:\"<p>Installation</p><ol>\n<li>Activate Plugin</li>\n<li>Add the usual columns to your import CSV: user_login, user_email, first_name, last_name, etc.</li>\n<li>Add the following columns to your import CSV. * = required for membership level, ** = required for gateway subscription<ul>\n<li>membership_id * (id of the membership level)</li>\n<li>membership_code_id</li>\n<li>membership_initial_payment</li>\n<li>membership_billing_amount</li>\n<li>membership_cycle_number</li>\n<li>membership_cycle_period</li>\n<li>membership_billing_limit</li>\n<li>membership_trial_amount</li>\n<li>membership_trial_limit</li>\n<li>membership_status</li>\n<li>membership_startdate</li>\n<li>membership_enddate</li>\n<li>membership_subscription_transaction_id ** (subscription transaction id or customer id from the gateway)</li>\n<li>membership_gateway ** (gateway = check, stripe, paypalstandard, paypalexpress, paypal (for website payments pro), payflowpro, authorizenet, braintree)</li>\n<li>membership_payment_transaction_id</li>\n<li>membership_affiliate_id</li>\n<li>membership_timestamp</li>\n</ul>\n</li>\n<li>Go to Users --&gt; Import From CSV. Browse to CSV file and import.<ul>\n<li>pmpro_stripe_customerid (for Stripe users, will be same as membership_subscription_transaction_id above)</li>\n</ul>\n</li>\n<li>(Optional) Send a welcome email by setting the global $pmproiufcsv_email. See example below.</li>\n<li>Go to Users --&gt; Import From CSV. Browse to CSV file and import.</li>\n</ol>\n<p>Copy these lines to your active theme\'s functions.php or custom plugin and modify as desired to send a welcome email to members after import:</p>\n<p>global $pmproiufcsv_email;\n$pmproiufcsv_email = array(\n\'subject\'   =&gt; sprintf(\'Welcome to %s\', get_bloginfo(\'sitename\')), //email subject, \"Welcome to Sitename\"\n\'body\'      =&gt; \'Your welcome email body text will go here.\'        //email body\n);</p>\";s:3:\"FAQ\";s:523:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-import-users-from-csv/issues\">https://github.com/strangerstudios/pmpro-import-users-from-csv/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:1066:\"<h4>Changelog</h4><p>0.4 - 2022-03-14</p><ul>\n<li>ENHANCEMENT: Added in an option to skip over members if trying to import members with their current membership level. This is helpful for large CSV files that may have duplicate records.</li>\n<li>ENHANCEMENT: Prevent subscriptions from being cancelled by incorrect imports. Keep these subscriptions in tact, but can disable this logic by using the <code>pmproiufcsv_cancel_prev_sub_on_import</code> filter.</li>\n<li>ENHANCEMENT: Show a notice if the Import Users From CSV (base) plugin isn\'t installed or activated which is required for this Add On to work.</li>\n<li>ENHANCEMENT: Improved general SQL scripts where possible by using prepare method from WPDB class.</li>\n<li>ENHANCEMENT: General improvements to localization of plugin, now translatable.</li>\n<li>BUG FIX: Fixed issue where expiration date (membership_enddate) was being set to import\'s date when importing pre-existing members. This now removes the expiration date for existing members if the membership_enddate column is blank or missing.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:84:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-import-users-from-csv.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Import Users from CSV\";}i:41;a:16:{s:4:\"Name\";s:42:\"Paid Memberships Pro - Infusionsoft Add On\";s:5:\"Title\";s:42:\"Paid Memberships Pro - Infusionsoft Add On\";s:9:\"PluginURI\";s:74:\"https://www.paidmembershipspro.com/add-ons/pmpro-infusionsoft-integration/\";s:4:\"Slug\";s:18:\"pmpro-infusionsoft\";s:6:\"plugin\";s:41:\"pmpro-infusionsoft/pmpro-infusionsoft.php\";s:7:\"Version\";s:3:\"1.4\";s:11:\"Description\";s:65:\"Sync your WordPress users and members with Infusionsoft contacts.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:61:\"https://downloads.wordpress.org/plugin/pmpro-infusionsoft.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:12:\"Infusionsoft\";}i:42;a:16:{s:4:\"Name\";s:41:\"Paid Memberships Pro - Invite Only Add On\";s:5:\"Title\";s:41:\"Paid Memberships Pro - Invite Only Add On\";s:9:\"PluginURI\";s:60:\"http://www.paidmembershipspro.com/add-ons/pmpro-invite-only/\";s:4:\"Slug\";s:17:\