\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:85:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-lock-membership-level.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Lock Membership Level\";}i:47;a:16:{s:4:\"Name\";s:39:\"Paid Memberships Pro - Mailchimp Add On\";s:5:\"Title\";s:39:\"Paid Memberships Pro - Mailchimp Add On\";s:9:\"PluginURI\";s:71:\"https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/\";s:4:\"Slug\";s:15:\"pmpro-mailchimp\";s:6:\"plugin\";s:35:\"pmpro-mailchimp/pmpro-mailchimp.php\";s:7:\"Version\";s:5:\"2.3.3\";s:11:\"Description\";s:63:\"Sync your WordPress users and members with Mailchimp audiences.\";s:12:\"Installation\";s:1523:\"<p>Installation</p><p>This plugin works with and without Paid Memberships Pro installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-mailchimp</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Settings &gt; PMPro Mailchimp to proceed with setup.</li>\n</ol><p>Configuration and Settings</p><p><strong>Enter your Mailchimp API Key:</strong> Your Mailchimp API key can be found within your Mailchimp account under Account &gt; Extras &gt; API keys. If you don\'t have a Mailchimp account, <a href=\"http://eepurl.com/k4aAH\">you can create one here</a>. Read our documentation for a <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/#api-key\">video demonstrating how to locate your Mailchimp API key</a>.</p>\n<p>After entering your API Key, continue with the setup by assigning User or Member Audiences and reviewing the additional settings.</p>\n<p>For full documentation on all settings, please visit the <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/\">Mailchimp Integration Add On documentation page at Paid Memberships Pro</a>. </p>\n<p>Several action and filter hooks are available for developers that need to customize specific aspects of the integration. <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/#hooks\">Please explore the plugin\'s action and filter hooks here</a>.</p>\";s:3:\"FAQ\";s:547:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-mailchimp/issues\">https://github.com/strangerstudios/pmpro-mailchimp/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href=\"http://www.paidmembershipspro.com/\">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:532:\"<h4>Changelog</h4><p>2.3.3 - 2023-03-01</p><ul>\n<li>ENHANCEMENT: Improved formatting of opt-in audience section on checkout page. (@mircobabini)</li>\n<li>ENHANCEMENT: Added filter <code>pmpromc_log_path</code> to allow changing the path where API calls are logged. (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Now using <code>readfile()</code> during CSV export if <code>fpassthru()</code> is not available. (@JarrydLong)</li>\n<li>REFACTOR: Marking the <code>set_user_interest()</code> method as deprecated. (@dparker1005)</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:58:\"https://downloads.wordpress.org/plugin/pmpro-mailchimp.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:9:\"Mailchimp\";}i:48;a:16:{s:4:\"Name\";s:38:\"Paid Memberships Pro - MailPoet Add On\";s:5:\"Title\";s:38:\"Paid Memberships Pro - MailPoet Add On\";s:9:\"PluginURI\";s:49:\"http://www.paidmembershipspro.com/pmpro-mailpoet/\";s:4:\"Slug\";s:36:\"MailPoet-Paid-Memberships-Pro-Add-on\";s:6:\"plugin\";s:77:\"MailPoet-Paid-Memberships-Pro-Add-on/MailPoet-Paid-Memberships-Pro-Add-on.php\";s:7:\"Version\";s:3:\"3.0\";s:11:\"Description\";s:58:\"Sync your WordPress users and members with MailPoet lists.\";s:12:\"Installation\";s:419:\"<p>Installation</p><p>This plugin requires both Paid Memberships Pro and MailPoet to be installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-mailpoet</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships &gt; PMPro MailPoet to proceed with setup.</li>\n</ol>\";s:3:\"FAQ\";s:589:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/MailPoet-Paid-Memberships-Pro-Add-on/issues\">https://github.com/strangerstudios/MailPoet-Paid-Memberships-Pro-Add-on/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href=\"http://www.paidmembershipspro.com/\">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:275:\"<h4>Changelog</h4><p>3.0 - 2022-09-05</p><ul>\n<li>FEATURE: Complete overhaul to support MailPoet v3+</li>\n</ul>\n<h2>Upgrade Notice</h2>\n<h3>3.0</h3>\n<p>This is a complete overhaul of the plugin to work with MailPoet v3. It will no longer work with MailPoet v2 or earlier.</p>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:79:\"https://downloads.wordpress.org/plugin/MailPoet-Paid-Memberships-Pro-Add-on.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:8: