ved escaping and sanitization throughout code.</li>\n<li>ENHANCEMENT: Added GitHub files for issue templates, README.md, and generate translations workflow.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:70:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-network.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:20:\"Member Network Sites\";}i:54;a:16:{s:4:\"Name\";s:40:\"Paid Memberships Pro - Member RSS Add On\";s:5:\"Title\";s:40:\"Paid Memberships Pro - Member RSS Add On\";s:9:\"PluginURI\";s:54:\"http://www.paidmembershipspro.com/wp/pmpro-member-rss/\";s:4:\"Slug\";s:16:\"pmpro-member-rss\";s:6:\"plugin\";s:37:\"pmpro-member-rss/pmpro-member-rss.php\";s:7:\"Version\";s:3:\"0.3\";s:11:\"Description\";s:57:\"Create Member-Specific RSS Feeds for Paid Memberships Pro\";s:12:\"Installation\";s:224:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-member-rss</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:555:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-member-rss/issues\">https://github.com/strangerstudios/pmpro-member-rss/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:703:\"<h4>Changelog</h4><p>0.3 - 2022-10-21</p>\n<ul>\n<li>FEATURE: You can now regenerate a user\'s RSS key from the edit user page of the WP dashboard.</li>\n<li>BUG FIX/ENHANCEMENT: Now using the pmpro_has_membership_access() function to account for all methods of protecting content.</li>\n<li>BUG FIX/ENHANCEMENT: Now also generating a member RSS key (if needed) on level change in case that happens outside of checkout.</li>\n<li>BUG FIX/ENHANCEMENT: Updating search queries so protected content is still visible in feeds when a member RSS key is used. </li>\n</ul>\n<p>= .2.</p><ul>\n<li>Now removing enclosures from member posts.</li>\n<li>Filtering the RSS content filter to show a link to the post.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:73:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-member-rss.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:10:\"Member RSS\";}i:55;a:16:{s:4:\"Name\";s:19:\"Memberlite Elements\";s:5:\"Title\";s:19:\"Memberlite Elements\";s:9:\"PluginURI\";s:52:\"https://www.memberlitetheme.com/memberlite-elements/\";s:4:\"Slug\";s:19:\"memberlite-elements\";s:6:\"plugin\";s:43:\"memberlite-elements/memberlite-elements.php\";s:7:\"Version\";s:5:\"1.0.9\";s:11:\"Description\";s:86:\"A set of elements designed enhance the appearance of sites using the Memberlite Theme.\";s:12:\"Installation\";s:679:\"<p>Installation</p><p>Download, Install and Activate</p><p>In your WordPress admin, go to Plugins &gt; Add New to install Memberlite Shortcodes, or:</p>\n<ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /memberlite-elements/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Start Using the Elements!</p><p>Browse the Memberlite Elements documentation to see all features, their attributes, and to view sample demos.</p>\n<p><a href=\"https://memberlitetheme.com/memberlite-elements/\">View Documentation</a></p>\";s:3:\"FAQ\";s:650:\"<p>Frequently Asked Questions</p><p>Where can I find Memberlite Elements documentation and user guides?</p><p>For help setting up and configuring the Memberlite Elements plugin, please refer to <a href=\"https://memberlitetheme.com/memberlite-elements/\">documentation</a>.</p><p>Where can I get the Memberlite Theme?</p><p>Visit <a href=\"https://memberlitetheme.com\">https://memberlitetheme.com</a> to get your copy of the Memberlite Theme.</p><p>I\'m not using the Memberlite Theme - can I still use Memberlite Elements plugin?</p><p>As of this release, Memberlite Elements is only compatible with the Memberlite Theme or a Memberlite Child Theme.</p>\";s:9:\"Changelog\";s:164:\"<h4>Changelog</h4><p>1.0.9 - 2023-06-13</p><ul>\n<li>ENHANCEMENT: Updated to Font Awesome version 6.4.</li>\n<li>ENHANCEMENT: Tested up to WordPress 6.2.2.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:31:\"https://www.memberlitetheme.com\";s:8:\"Download\";s:62:\"https://downloads.wordpress.org/plugin/memberlite-elements.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:19:\"Memberlite Elements\";}i:56;a:16:{s:4:\"Name\";s:21:\"Memberlite Shortcodes\";s:5:\"Title\";s:21:\"Memberlite Shortcodes\";s:9:\"PluginURI\";s:50:\"https://memberlitetheme.com/memberlite-shortcodes/\";s:4:\"Slug\";s:21:\"memberlite-shortcodes\";s:6:\"plugin\";s:47:\"memberlite-shortcodes/memberlite-shortcodes.php\";s:7:\"Version\";s:5:\"1.3.8\";s:11:\"Description\";s:82:\"Shortcodes designed to work with the Memberlite Theme and Memberlite Child Themes.\";s:12:\"Installation\";s:699:\"<p>Installation</p><p>Download, Install and Activate</p><p>In your WordPress admin, go to Plugins &gt; Add New to install Memberlite Shortcodes, or:</p>\n<ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /memberlite-shortcodes/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Start Using the Shortcodes!</p><p>Browse the Memberlite Shortcodes documentation to see all shortcodes, their attributes, and to view sample shortcode demos.</p>\n<p><a href=\"https://memberlitetheme.com/memberlite-shortcodes/\">View Documentation</a></p>\";s:3:\"FAQ\";s:681:\"<p>Frequently Asked Questions</p><p>Where can I find Memberlite Shortcodes documentation and user guides?</p><p>For help setting up and configuring the Memberlite Shortcodes plugin, please refer to <a href=\"https://memberlitetheme.com/memberlite-shortcodes/\">documentation</a>.</p><p>Where can I get the Memberlite Theme?</p><p>Visit <a href=\"https://memberlitetheme.com\">https://memberlitetheme.com</a> to get your copy of the Memberlite Theme.</p><p>I\'m not using the Memberlite Theme - can I still use Memberlite Shortcodes plugin?</p><p>Some of the shortcodes in this plugin will work with any theme, but we cannot guarantee the appearance will match that of the demo site.</p>\";s:9:\"Changelog\";s:266:\"<h4>Changelog</h4><p>1.3.8 - 2023-06-13</p><ul>\n<li>ENHANCEMENT: Now supporting Font Awesome shortcode attributes for rotate, flip, and animate.</li>\n<li>ENHANCEMENT: Updated to Font Awesome version 6.4.</li>\n<li>ENHANCEMENT: Tested up to WordPress 6.2.2.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:27:\"https://memberlitetheme.com\";s:8:\"Download\";s:64:\"https://downloads.wordpress.org/plugin/memberlite-shortcodes.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:21:\"Memberlite Shortcodes\";}i:57;a:16:{s:4:\"Name\";s:45:\"Paid Memberships Pro - Membership Card Add On\";s:5:\"Title\";s:45:\"Paid Memberships Pro - Membership Card Add On\";s:9:\"PluginURI\";s:59:\"http://www.paidmembershipspro.com/wp/pmpro-membership-card/\";s:4:\"Slug\";s:21:\"pmpro-membership-card\";s:6:\"plugin\";s:47:\"pmpro-membership-card/pmpro-membership-card.php\";s:7:\"Version\";s:5:\"1.1.2\";s:11:\"Description\";s:81:\"Display a printable Membership Card for Paid Memberships Pro members or WP users.\";s:12:\"Installation\";s:736:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-membership-card</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Create a page and add the [pmpro_membership_card] shortcode to it.</li>\n<li>(Optional) The page\'s \"featured image\" will be added to the membership card.</li>\n<li>(Optional) Specify the shortcode attribute \'print_size\'. Options include: small, medium, large or all. Default is: all. (ex: [pmpro_membership_card print_size=\"small,medium\"])</li>\n<li>(Optional) Copy the pmpro-membership-card/templates/membership-card.php file to your active theme\'s directory and edit it to change the card template.</li>\n</ol>\";s:3:\"FAQ\";s:319:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-membership-card/issues\">https://github.com/strangerstudios/pmpro-membership-card/issues</a></p>\";s:9:\"Changelog\";s:254:\"<h4>Changelog</h4><p>1.1.2 - 2023-02-02</p><ul>\n<li>ENHANCEMENT: Added compatibility for using the [pmpro_membership_card] in custom post types (@JarrydLong)</li>\n<li>BUG FIX: Fixed an issue when qr_data attribute was set to an invalid option.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:82:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-membership-card.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:15:\"Membership Card\";}i:58;a:16:{s:4:\"Name\";s:53:\"Paid Memberships Pro - Membership Manager Role Add On\";s:5:\"Title\"