ur Google Maps API Key on the Memberships &gt; Settings &gt; Advanced Settings page in the WordPress admin. <a href=\"https://www.paidmembershipspro.com/add-ons/membership-maps/#google-maps-api-key\">Click here for help obtaining up your Google Maps API Key</a>.</li>\n</ol>\";s:3:\"FAQ\";s:567:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-membership-maps/issues\">https://github.com/strangerstudios/pmpro-membership-maps/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:435:\"<h4>Changelog</h4><p>0.5 - 2022-09-22</p><ul>\n<li>ENHANCEMENT: Test the API request whenever saving a new API Key to ensure it\'s all setup correctly.</li>\n<li>ENHANCEMENT: Improved functionality and sanitzation of custom fields in marker windows. URL values now are clickable.</li>\n<li>ENHANCEMENT: Geocode user address whenever their profile is saved or updated and billing fields are present on the edit user/profile page.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:78:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-membership-maps.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:15:\"Membership Maps\";}i:60;a:16:{s:4:\"Name\";s:52:\"Paid Memberships Pro - Multiple Memberships per User\";s:5:\"Title\";s:52:\"Paid Memberships Pro - Multiple Memberships per User\";s:9:\"PluginURI\";s:70:\"http://www.paidmembershipspro.com/pmpro-multiple-memberships-per-user/\";s:4:\"Slug\";s:35:\"pmpro-multiple-memberships-per-user\";s:6:\"plugin\";s:75:\"pmpro-multiple-memberships-per-user/pmpro-multiple-memberships-per-user.php\";s:7:\"Version\";s:5:\"0.8.4\";s:11:\"Description\";s:91:\"Update PMPro to allow users to checkout for and hold multiple memberships at the same time.\";s:12:\"Installation\";s:227:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-multiple-memberships-per-user</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:279:\"<h4>Changelog</h4><p>0.8.4 - 2023-06-14</p><ul>\n<li>BUG FIX: Added additional check to prevent JavaScript from loading on pages other than the checkout page.</li>\n<li>REFACTOR: Added version to Checkout page template to avoid outdated template warnings in PMPro v2.11+</li>\n</ul>\";s:6:\"Author\";s:37:\"Square Lines LLC and Stranger Studios\";s:9:\"AuthorURI\";s:27:\"http://www.square-lines.com\";s:8:\"Download\";s:92:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-multiple-memberships-per-user.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:29:\"Multiple Memberships per User\";}i:61;a:16:{s:4:\"Name\";s:50:\"Paid Memberships Pro - Multisite Membership Add On\";s:5:\"Title\";s:50:\"Paid Memberships Pro - Multisite Membership Add On\";s:9:\"PluginURI\";s:68:\"https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/\";s:4:\"Slug\";s:21:\"pmpro-network-subsite\";s:6:\"plugin\";s:47:\"pmpro-network-subsite/pmpro-network-subsite.php\";s:7:\"Version\";s:5:\"0.4.5\";s:11:\"Description\";s:139:\"Manage memberships at the network’s main site (the primary domain of the network) and provide/restrict access on subsites in the network.\";s:12:\"Installation\";s:1259:\"<p>Installation</p><ol>\n<li>Install Paid Memberships Pro via Network Admin &gt; Plugins &gt; Add New. Do not \"Network Activate\" the plugin.</li>\n<li>On your main network site, activate and configure Paid Memberships Pro by following the Initial Plugin Setup guide.</li>\n<li>Upload the \'pmpro-network-subsite\' directory to the \'wp-content/plugins/\' directory of your WordPress Multisite environment.</li>\n<li>For each site in your network that has member content, navigate to the site\'s Dashboard &gt; Plugins. Activate Paid Memberships Pro AND the Multisite Membership Add On.</li>\n<li>DO NOT activate the \'pmpro-network-subsite\' plugin on the “Main” site (i.e. where people checkout) of your network.</li>\n<li>Make sure that the constant PMPRO_NETWORK_MAIN_DB_PREFIX is properly defined for your main network site in your wp-config.php file. For example: define(\'PMPRO_NETWORK_MAIN_DB_PREFIX\', \'wp\');</li>\n</ol>\n<p>You will now be able to create members-only content on subsites in the network. The membership levels of your main site are mirrored in each subsite.</p>\n<p>Read full documentation at <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/\">https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/</a></p>\";s:3:\"FAQ\";s:511:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-network-subsite/issues\">https://github.com/strangerstudios/pmpro-network-subsite/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:120:\"<h4>Changelog</h4><p>0.4.5 - 2021-10-21</p><ul>\n<li>BUG FIX: Fixed issue when activated without PMPro active.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:78:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-network-subsite.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:20:\"Multisite Membership\";}i:62;a:16:{s:4:\"Name\";s:39:\"Paid Memberships Pro - Nav Menus Add On\";s:5:\"Title\";s:39:\"Paid Memberships Pro - Nav Menus Add On\";s:9:\"PluginURI\";s:59:\"https://www.paidmembershipspro.com/add-ons/pmpro-nav-menus/\";s:4:\"Slug\";s:15:\"pmpro-nav-menus\";s:6:\"plugin\";s:35:\"pmpro-nav-menus/pmpro-nav-menus.php\";s:7:\"Version\";s:3:\"0.4\";s:11:\"Description\";s:100:\"Creates member navigation menus and swaps your theme\'s navigation based on a user\'s Membership Level\";s:12:\"Installation\";s:422:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-nav-menus</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Optionally create level-specific navigation menus on the <code>Edit Membership Level</code> admin.</li>\n<li>Create new navigation menu(s) for your members and assign them to the appropriate Theme Location.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:76:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-nav-menus.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:9:\"Nav Menus\";}i:63;a:16:{s:4:\"Name\";s:42:\"Paid Memberships Pro - Pay by Check Add On\";s:5:\"Title\";s:42:\"Paid Memberships Pro - Pay by Check Add On\";s:9:\"PluginURI\";s:69:\"https://www.paidmembershipspro.com/add-ons/pmpro-pay-by-check-add-on/\";s:4:\"Slug\";s:18:\"pmpro-pay-by-check\";s:6:\"plugin\";s:41:\"pmpro-pay-by-check/pmpro-pay-by-check.php\";s:7:\"Version\";s:4:\"0.11\";s:11:\"Description\";s:106:\"A collection of customizations useful when allowing users to pay by check for Paid Memberships Pro levels.\";s:12:\"Installation\";s:843:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-pay-by-check</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Change your Payment Settings to the \"Pay by Check\" gateway and make sure to set the \"Instructions\" with instructions for how to pay by check. Save.</li>\n<li>Change the Payment Settings back to use your gateway of choice. Behind the scenes the Pay by Check settings are still stored.</li>\n<li>Edit your membership levels and set the \"Pay by Check Settings\" for each level.</li>\n</ol>\n<p>If you would like to change the wording from \"Pay by Check\" to something else, you can use this custom code:\n<a href=\"https://gist.github.com/strangerstudios/68bb75bf3b83530390d4\">https://gist.github.com/strangerstudios/68bb75bf3b83530390d4</a></p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:937:\"<h4>Changelog</h4><p>0.11 - 2022-09-14</p><ul>\n<li>ENHANCEMENT: Tweaked the confirmation message on the confirmation page to clearly show that no access is available until payment is received.</li>\n<li>ENHANCEMENT: Improved cases where orders would stay in pending if members checked out for the same level but change their payment method. Previous orders now are set with the \"token\" status if switching gateways and had a pending status with check payment.</li>\n<li>BUG FIX: Improved compatibility for cases like Auto Renewal Checkbox where a level may have recurring and non-recurring options. This fixes an issue where non-recurring members would still be cancelled or receive renewal reminders.</li>\n<li>BUG FIX: Various fixes to support and improve compatibility with PHP8+ (Thanks @ZebulanStanphill, @jarrydlong).</li>\n<li>BUG FIX: Fixed an issue where [membership level=\"0\"] would display incorrectly (Thanks @ipokkel)</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:79:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-pay-by-check.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:12:\"Pay by Check\";}i:64;a:16:{s:4:\"Name\";s:38:\"Paid Memberships Pro - PayFast Gateway\";s:5:\"Title\";s:38:\"Paid Memberships Pro - PayFast Gateway\";s:9:\"PluginURI\";s:67:\"https://www.paidmembershipspro.com/add-ons/payfast-payment-gateway/\";s:4:\"Slug\";s:13:\"pmpro-payfast\";s:6:\"plugin\";s:31:\"pmpro-payfast/pmpro-payfast.php\";s:7:\"Version\";s:5:\"1.3.0\";s:11:\"Description\";s:58:\"Adds PayFast as a gateway option for Paid Memberships Pro.\";s:12:\"Installation\";s:1021:\"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-payfast</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Go to Memberships -&gt; Payment Settings in your WordPress dashboard to complete the PayFast settings.</li>\n</ol><p>Setup</p><ol>\n<li>Register and validate your account with PayFast: <a href=\"https://www.payfast.co.za/user/register\">https://www.payfast.co.za/user/register</a>.</li>\n<li>Log in to your PayFast account and select \'Settings\' to retrieve your merchant details.</li>\n<li>Log in to your WordPress dashboard and navigate to Memberships &gt; Payment Settings.</li>\n<li>Set your \"Payment Gateway\" to \"PayFast\". Fill out your merchant details and Security Passphrase (required in order to accept recurring payments).</li>\n<li>Set your currency to \"South African Rand\".</li>\n<li>Save your settings.</li>\n</ol>\";s:3:\"FAQ\";s:1038:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-payfast/issues\">https://github.com/strangerstudios/pmpro-payfast/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need to test PayFast in sandbox mode.</p><p>To test PayFast payments without being billed in sandbox mode requires a sandbox account from PayFast. For more information in creating a sandbox account - <a href=\"https://developers.payfast.co.za/documentation/#the-sandbox\">https://developers.payfast.co.za/documentation/#the-sandbox</a></p>\";s:9:\"Changelog\";s:507:\"<h4>Changelog</h4><p>1.3.0 - 2021-12-15</p><ul>\n<li>ENHANCEMENT: Set the default order status to \"token\" instead of \"pending\".</li>\n<li>ENHANCEMENT: Hide the Update/Cancel buttons on the membership billing page when PayFast is used.</li>\n<li>BUG FIX: Fixed fatal error where method was called incorrectly on the membership billing page.</li>\n<li>BUG FIX: Rename filter in the ITN Handler to prevent conflicts. Filter name changed from \'pmpro_ipnhandler_level\' to \'pmpro_payfast_itnhandler_level\'.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:56:\"https://downloads.wordpress.org/plugin/pmpro-payfast.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:15:\"PayFast Gateway\";}i:65;a:16:{s:4:\"Name\";s:54:\"Paid Memberships Pro - Payflow Recurring Orders Add On\";s:5:\"Title\";s:54:\"Paid Memberships Pro - Payflow Recurring Orders Add On\";s:9:\"PluginURI\";s:74:\"https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/\";s:4:\"Slug\";s:30:\"pmpro-payflow-recurring-orders\";s:6:\"plugin\";s:65:\"pmpro-payflow-recurring-orders/pmpro-payflow-recurring-orders.php\";s:7:\"Version\";s:2:\".3\";s:11:\"Description\";s:72:\"Check daily for new recurring orders in Payflow and add as PMPro orders.\";s:12:\"Installation\";s:703:\"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-payflow-recurring-orders/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That’s it. No settings.</li>\n</ol>\n<p>View full documentation at: <a href=\"https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/\">https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/</a></p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:315:\"<h4>Changelog</h4><p>.3</p><ul>\n<li>BUG FIX/ENHANCEMENT: Removed the code to only run the cron between 1AM and 6AM. Instead, it will run every hour and you can use the new pmpro_payflow_recurring_orders_skip_cron filter to return true during those times if you\'d like to skip the cron during heavy times.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:33:\"htts://www.paidmembershipspro.com\";s:8:\"Download\";s:88:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-payflow-recurring-orders.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:24:\"Payflow Recurring Orders\";}i:66;a:16:{s:4:\"Name\";s:43:\"Paid Memberships Pro - Payment Plans Add On\";s:5:\"Title\";s:43:\"Paid Memberships Pro - Payment Plans Add On\";s:9:\"PluginURI\";s:63:\"https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/\";s:4:\"Slug\";s:19:\"pmpro-payment-plans\";s:6:\"plugin\";s:43:\"pmpro-payment-plans/pmpro-payment-plans.php\";s:7:\"Version\";s:3:\"0.2\";s:11:\"Description\";s:84:\"Integrates with Paid Memberships Pro to provide payment plans for membership levels.\";s:12:\"Installation\";s:1381:\"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-approvals/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>Create a membership level and set the pricing on the level to the default or most popular payment you offer. For example, set the main level up as a fixed price per month.</li>\n<li>Then, locate the “Payment Plans” section and click the “Add Payment Plan” button.</li>\n<li>Expand the individual payment plan to adjust the name, pricing details, and any additional settings related to expiration or trials.</li>\n<li>Add additional payment plans if you’d like to offer more than one. The default level pricing will be shown first in the list with any additional active payment plans shown below.</li>\n<li>Save the membership level and browse to the checkout page for that level to see your plans in action.</li>\n</ol>\n<p>View full documentation at: <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/\">https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/</a></p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:564:\"<h4>Changelog</h4><p>0.2 - 2023-01-03</p><ul>\n<li>ENHANCEMENT: Added better UI for inactive plans. (@JarrydLong)</li>\n<li>ENHANCEMENT: Improved support for Addon Packages. (@JarrydLong)</li>\n<li>ENHANCEMENT: Improved logic for determining when to load the javascript on the frontend. (@ipokkel)</li>\n<li>ENHANCEMENT: Improved logic for determining when to run the save payment plan logic in the admin area. (@ipokkel)</li>\n<li>BUG FIX: Fixed an issue in settings where dropdown values would not reflect actual saved settings. (@JarrydLong, @dparker1005)</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:76:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-payment-plans.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:13:\"Payment Plans\";}i:67;a:16:{s:4:\"Name\";s:25:\"PMPro Levels as UL Layout\";s:5:\"Title\";s:25:\"PMPro Levels as UL Layout\";s:9:\"PluginURI\";s:53:\"http://www.paidmembershipspro.com/wp/pmpro-ul-levels/\";s:4:\"Slug\";s:15:\"pmpro-ul-levels\";s:6:\"plugin\";s:35:\"pmpro-ul-levels/pmpro-ul-levels.php\";s:7:\"Version\";s:2:\".1\";s:11:\"Description\";s:107:\"Display your Membership Levels page in a UL Layout (includes classes for Foundation by ZURB Pricing table).\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:42:\"Stranger Studios / Tweaked by Lasse Larsen\";s:9:\"AuthorURI\";s:28:\"http://www.seventysixnyc.com\";s:8:\"Download\";s:73:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-ul-levels.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"1\";s:9:\"ShortName\";s:25:\"PMPro Levels as UL Layout\";}i:68;a:16:{s:4:\"Name\";s:34:\"Paid Memberships Pro - Pods Add On\";s:5:\"Title\";s:34:\"Paid Memberships Pro - Pods Add On\";s:9:\"PluginURI\";s:60:\"https://www.paidmembershipspro.com/add-ons/pods-integration/\";s:4:\"Slug\";s:10:\"pmpro-pods\";s:6:\"plugin\";s:25:\"pmpro-pods/pmpro-pods.php\";s:7:\"Version\";s:5:\"1.0.2\";s:11:\"Description\";s:232:\"Integrates Paid Memberships Pro with the Pods Framework to add groups of fields to many areas of your membership site including Member Profiles, the Membership Checkout page, and admin screens including Membership Levels and Orders.\";s:12:\"Installation\";s:323:\"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro and Pods Framework plugins installed and activated.</li>\n<li>Upload the <code>pmpro-pods</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:690:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-pods/issues\">https://github.com/strangerstudios/pmpro-pods/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:631:\"<h4>Changelog</h4><p>1.0.2 - January 4th, 2022</p><ul>\n<li>ENHANCEMENT: Added support for two new locations on the PMPro checkout page: After User Fields and Checkout Boxes. (@sc0ttkclark)</li>\n<li>BUG FIX: Improved appearance of Pods fields on the PMPro checkout page so they more closely match styles used by PMPro. (@sc0ttkclark)</li>\n<li>BUG FIX: Prevent PHP notices from usage of certain PMPro hooks when <code>$user</code> object is not passed in. (@sc0ttkclark)</li>\n<li>BUG FIX: Prevent PHP notices on the PMPro checkout page when the PMPro Member pod does not exist and has not yet been extended. (@sc0ttkclark)</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:53:\"https://downloads.wordpress.org/plugin/pmpro-pods.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:4:\"Pods\";}i:69;a:16:{s:4:\"Name\";s:60:\"Paid Memberships Pro - Post Affiliate Pro Integration Add On\";s:5:\"Title\";s:60:\"Paid Memberships Pro - Post Affiliate Pro Integration Add On\";s:9:\"PluginURI\";s:62:\"http://www.paidmembershipspro.com/wp/pmpro-post-affiliate-pro/\";s:4:\"Slug\";s:24:\"pmpro-post-affiliate-pro\";s:6:\"plugin\";s:53:\"pmpro-post-affiliate-pro/pmpro-post-affiliate-pro.php\";s:7:\"Version\";s:6:\".2.1.1\";s:11:\"Description\";s:67:\"Process an affiliate via Post Affiliate Pro after a PMPro checkout.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:82:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-post-affiliate-pro.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:30:\"Post Affiliate Pro Integration\";}i:70;a:16:{s:4:\"Name\";s:39:\"Paid Memberships Pro - Proration Add On\";s:5:\"Title\";s:39:\"Paid Memberships Pro - Proration Add On\";s:9:\"PluginURI\";s:53:\"http://www.paidmembershipspro.com/wp/pmpro-proration/\";s:4:\"Slug\";s:15:\"pmpro-proration\";s:6:\"plugin\";s:35:\"pmpro-proration/pmpro-proration.php\";s:7:\"Version\";s:4:\".3.1\";s:11:\"Description\";s:46:\"Custom Prorating Code for Paid Memberships Pro\";s:12:\"Installation\";s:207:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-proration</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:130:\"<h4>Changelog</h4><p>.3.1</p><ul>\n<li>BUG FIX: Added a check to the filter of pmpro_checkout_level to bail if no level.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:73:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-proration.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:9:\"Proration\";}i:71;a:16:{s:4:\"Name\";s:51:\"Paid Memberships Pro - Reason For Cancelling Add On\";s:5:\"Title\";s:51:\"Paid Memberships Pro - Reason For Cancelling Add On\";s:9:\"PluginURI\";s:67:\"https://www.paidmembershipspro.com/add-ons/pmpro-reason-cancelling/\";s:4:\"Slug\";s:27:\"pmpro-reason-for-cancelling\";s:6:\"plugin\";s:59:\"pmpro-reason-for-cancelling/pmpro-reason-for-cancelling.php\";s:7:\"Version\";s:5:\"0.2.1\";s:11:\"Description\";s:67:\"Adds a field to specify a reason for cancelling to the cancel page.\";s:12:\"Installation\";s:235:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-reason-for-cancelling</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:331:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-reason-for-cancelling/issues\">https://github.com/strangerstudios/pmpro-reason-for-cancelling/issues</a></p>\";s:9:\"Changelog\";s:175:\"<h4>Changelog</h4><p>0.2.1 - 2021-09-13</p><ul>\n<li>BUG FIX/ENHANCEMENT: Now ensuring that <code>levelstocancel</code> URL parameter is set when cancelling a level.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:84:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-reason-for-cancelling.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:21:\"Reason For Cancelling\";}i:72;a:16:{s:4:\"Name\";s:46:\"Paid Memberships Pro - Recurring Emails Add On\";s:5:\"Title\";s:46:\"Paid Memberships Pro - Recurring Emails Add On\";s:9:\"PluginURI\";s:60:\"http://www.paidmembershipspro.com/wp/pmpro-recurring-emails/\";s:4:\"Slug\";s:22:\"pmpro-recurring-emails\";s:6:\"plugin\";s:49:\"pmpro-recurring-emails/pmpro-recurring-emails.php\";s:7:\"Version\";s:5:\"0.5.5\";s:11:\"Description\";s:93:\"Send email message(s) X days before a recurring payment is scheduled, to warn/remind members.\";s:12:\"Installation\";s:230:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-recurring-emails</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\";s:3:\"FAQ\";s:567:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-recurring-emails/issues\">https://github.com/strangerstudios/pmpro-recurring-emails/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:353:\"<h4>Changelog</h4><p>0.5.5 - 2022-11-29</p><ul>\n<li>ENHANCEMENT: Added !!billing_amount!! and !!membership_cost!! as variables for this email.</li>\n<li>BUG FIX: Now using sprintf to error log instead of printf. This fixes an issue in certain PHP versions that was causing fatal errors resulting in multiple emails going out to the same users.</li>\n</ul>\";s:6:\"Author\";s:64:\"Stranger Studios, Thomas Sjolshagen <thomas@eighty20results.com>\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:83:\"http://license.paidmembershipspro.com/downloads/standard/pmpro-recurring-emails.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:16:\"Recurring Emails\";}i:73;a:16:{s:4:\"Name\";s:45:\"Paid Memberships Pro - Register Helper Add On\";s:5:\"Title\";s:45:\"Paid Memberships Pro - Register Helper Add On\";s:9:\"PluginURI\";s:97:\"https://www.paidmembershipspro.com/add-ons/pmpro-register-helper-add-checkout-and-profile-fields/\";s:4:\"Slug\";s:21:\"pmpro-register-helper\";s:6:\"plugin\";s:47:\"pmpro-register-helper/pmpro-register-helper.php\";s:7:\"Version\";s:5:\"1.8.3\";s:11:\"Description\";s:90:\"Add custom form fields to membership checkout and user profiles with Paid Memberships Pro.\";s:12:\"Installation\";s:2976:\"<p>Installation</p><p>Note: This plugin doesn\'t require <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a>, but it is strongly recommended for sites that want to build a membership site and capture user profile information as part of free or paid member registration.</p>\n<h3>Install PMPro Register Helper from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro Register Helper\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - Register Helper Add On\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro Register Helper Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-register-helper</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - Register Helper\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Set Up Your Custom Fields</h3><p>Adding Fields to Membership Checkout</p><p>Register Helper allows you to add fields to a variety of places within the Membership Checkout page using Paid Memberships Pro. Fields can be added to existing locations including:</p>\n<ul>\n<li>after_username</li>\n<li>after_password</li>\n<li>after_email</li>\n<li>after_captcha</li>\n<li>after_billing_fields</li>\n<li>before_submit_button</li>\n</ul>\n<p>If you would like to add fields to the profile only, specify the \'just_profile\' location.</p>\n<p>Fields must be configured using custom code. We offer support for creating up to 5 fields as part of your <a href=\"https://www.paidmembershipspro.com/pricing/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper\">premium membership</a>.</p>\n<p><a href=\"https://www.paidmembershipspro.com/documentation/register-helper-documentation/adding-fields/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper\">View the full documentation on adding fields</a> and <a href=\"https://www.youtube.com/watch?v=VVTHYPQpfZ4\">check out this video demo on Register Helper set up</a>.</p><p>Adding New Sections to Membership Checkout</p><p>You can add a new box or \'section\' to the Membership Checkout form using the \'checkout_boxes\' feature. Your newly created box includes a title, description, and loads in the specified location.</p>\n<p><a href=\"https://www.paidmembershipspro.com/documentation/register-helper-documentation/adding-fields/#checkout-boxes?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper\">Read the documentation on Custom Checkout Boxes</a></p><p>Restrict Membership Checkout by Email Address or Username</p><p>Add your list of custom \"approved\" email addresses or usernames to the \"Restrict by Email\" or \"Restrict by Username\" field on the Memberships &gt; Settings &gt; Membership Levels &gt; Edit Level admin page.</p>\";s:3:\"FAQ\";s:319:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-register-helper/issues\">https://github.com/strangerstudios/pmpro-register-helper/issues</a></p>\";s:9:\"Changelog\";s:147:\"<h4>Changelog</h4><p>1.8.3 - 2023-03-17</p><ul>\n<li>BUG FIX: Reverting v1.8.2 changes which were not needed and potentially problematic.</li>\n</ul>\";s:6:\"Author\";s:20: