wlimaza)</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:79:\"http://license.paidmembershipspro.com/downloads/free/pmpro-strong-passwords.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:24:\"Require Strong Passwords\";}i:76;a:16:{s:4:\"Name\";s:35:\"Paid Memberships Pro - Roles Add On\";s:5:\"Title\";s:35:\"Paid Memberships Pro - Roles Add On\";s:9:\"PluginURI\";s:55:\"https://www.paidmembershipspro.com/add-ons/pmpro-roles/\";s:4:\"Slug\";s:11:\"pmpro-roles\";s:6:\"plugin\";s:27:\"pmpro-roles/pmpro-roles.php\";s:7:\"Version\";s:5:\"1.4.2\";s:11:\"Description\";s:48:\"Adds a WordPress Role for each Membership Level.\";s:12:\"Installation\";s:252:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-roles</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That\'s it. No settings.</li>\n</ol>\";s:3:\"FAQ\";s:547:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-roles/issues\">https://github.com/strangerstudios/pmpro-roles/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"https://www.paidmembershipspro.com\">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:242:\"<h4>Changelog</h4><p>1.4.2 - 2022-12-12</p><ul>\n<li>ENHANCEMENT: Improved UI for role selection in the edit level settings.</li>\n<li>BUG FIX: Fixed issue where fatal error was being caused when Paid Memberships Pro was deactivated.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:68:\"http://license.paidmembershipspro.com/downloads/free/pmpro-roles.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:5:\"Roles\";}i:77;a:16:{s:4:\"Name\";s:36:\"Paid Memberships Pro - Series Add On\";s:5:\"Title\";s:36:\"Paid Memberships Pro - Series Add On\";s:9:\"PluginURI\";s:78:\"https://www.paidmembershipspro.com/add-ons/pmpro-series-for-drip-feed-content/\";s:4:\"Slug\";s:12:\"pmpro-series\";s:6:\"plugin\";s:29:\"pmpro-series/pmpro-series.php\";s:7:\"Version\";s:2:\".5\";s:11:\"Description\";s:59:\"Offer serialized (drip feed) content to your PMPro members.\";s:12:\"Installation\";s:403:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-series</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to the Series menu in the WordPress dashboard to create a new series.</li>\n<li>Add posts to series using the \"Posts in this Series\" meta box under the post content.</li>\n</ol>\";s:3:\"FAQ\";s:301:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-series/issues\">https://github.com/strangerstudios/pmpro-series/issues</a></p>\";s:9:\"Changelog\";s:2543:\"<h4>Changelog</h4><p>0.5 - 2020-10-16=</p>\n<ul>\n<li>ENHANCEMENT: Now showing a different message at the top of a series when all content is now available.</li>\n<li>ENHANCEMENT: Now wrapping content of series pages in a <div> so that it can be targeted with CSS.</li>\n<li>ENHANCEMENT: Added classes around text at the top of series pages so that it can be targeted with CSS.</li>\n<li>ENHANCEMENT: Now using date_i18n() instead of date().</li>\n<li>BUG FIX/ENHANCEMENT: Posts that have not yet been published will no longer be shown in series on frontend.</li>\n<li>BUG FIX/ENHANCEMENT: Updated select2 library.</li>\n<li>BUG FIX: Fixed issue where custom \"new_content.html\" files would not be found.</li>\n<li>BUG FIX: Now updating \"_post_series\" postmeta when a series is deleted.</li>\n<li>BUG FIX: Fixed PHP warning when sending the \"new_content.html\" email.</li>\n<li>BUG FIX: Fixed issue where startdates may have been shifted based on SQL timezone.</li>\n</ul>\n<p>= .4.1 - 2020-01-09=</p>\n<ul>\n<li>BUG FIX: Fixed issues where posts belonging to more than one series would show up multiple times in the new content email.</li>\n<li>BUG FIX: Fixed JavaScript issues of posts/pages not being added to series.</li>\n</ul>\n<p>= .4</p><ul>\n<li>BUG FIX: Fixed issues that came up if PMPro was not active.</li>\n<li>BUG FIX: Fixes issues when running certain versions of PHP.</li>\n<li>BUG FIX: Fixed issue where users couldn\'t access pages that were part of a deleted series. (Thanks, Thomas Sjolshagen)</li>\n<li>BUG FIX/ENHANCEMENT: Works with Gutenberg and PMPro 2.0+ now.</li>\n<li>BUG FIX/ENHANCEMENT: You can now add posts into a series before saving/refreshing a new post.</li>\n<li>BUG FIX/ENHANCEMENT: Fixed menu_icon for Series CPT to use dashicons-clock in place of custom image.</li>\n<li>BUG FIX/ENHANCEMENT: Updated to the latest version of select2.</li>\n<li>BUG FIX/ENHANCEMENT: Using current_time(\'timestamp\') instead of time(). (Thanks, Thomas Sjolshagen)</li>\n<li>ENHANCEMENT: Wrapped strings for translation and added French language files. (Thanks, Charlie Merland)</li>\n<li>ENHANCEMENT: Added pmpros_days_left_message, pmpros_content_access_message_single_item, and pmpros_content_access_message_many_items filters to filter the text shown in certain cases via hooks. (Thanks, Curtis McHale)</li>\n<li>ENHANCEMENT: Added pmpros_new_content_subject filter. (Thanks, Curtis McHale)</li>\n<li>ENHANCEMENT: Improved styling of the series list.</li>\n<li>ENHANCEMENT: Updating to add support for the Email Templates Admin Editor Add On.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:69:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-series.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:6:\"Series\";}i:78;a:16:{s:4:\"Name\";s:27:\"Seriously Simple Podcasting\";s:5:\"Title\";s:27:\"Seriously Simple Podcasting\";s:9:\"PluginURI\";s:122:\"https://castos.com/seriously-simple-podcasting/?utm_medium=sspodcasting&utm_source=wordpress&utm_campaign=wpplugin_08_2019\";s:4:\"Slug\";s:27:\"seriously-simple-podcasting\";s:6:\"plugin\";s:59:\"seriously-simple-podcasting/seriously-simple-podcasting.php\";s:7:\"Version\";s:6:\"2.13.0\";s:11:\"Description\";s:104:\"Podcasting the way it\'s meant to be. No mess, no fuss - just you and your content taking over the world.\";s:12:\"Installation\";s:845:\"<p>Installation</p><p>Installing \"Seriously Simple Podcasting\" can be done either by searching for \"Seriously Simple Podcasting\" via the \"Plugins &gt; Add New\" screen in your WordPress dashboard, or by using the following steps:</p>\n<ol>\n<li>Download the plugin via WordPress.org</li>\n<li>Upload the ZIP file through the \'Plugins &gt; Add New &gt; Upload\' screen in your WordPress dashboard</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress</li>\n<li>Customise the plugin from the \'Podcast &gt; Settings\' page</li>\n</ol><p>Where are the FAQs?</p><p>You can find complete user and developer documentation (along with the FAQs) on <a href=\"https://castos.com/podcast-hosting-wordpress/?utm_medium=sspodcasting&amp;utm_source=wordpress&amp;utm_campaign=wpplugin_08_2019\">the Seriously Simple Podcasting documentation site</a>.</p>\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:703:\"<h4>Changelog</h4><p>2.13.0</p><ul>\n<li>2022-04-18</li>\n<li>UPDATE SUMMARY: Podping notification when feed is updated, code refactoring, minor improvements