67:\"https://www.paidmembershipspro.com/add-ons/pmpro-sponsored-members/\";s:4:\"Slug\";s:23:\"pmpro-sponsored-members\";s:6:\"plugin\";s:51:\"pmpro-sponsored-members/pmpro-sponsored-members.php\";s:7:\"Version\";s:6:\"0.10.1\";s:11:\"Description\";s:84:\"Generate discount code for a main account holder to distribute to sponsored members.\";s:12:\"Installation\";s:702:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-sponsored-members</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Create one level for paying account holders and one level for sponsored members.</li>\n<li>Edit the PMPROSM_MAIN_ACCOUNT_LEVEL constant in the plugin file to match your main account level id.</li>\n<li>Edit the PMPROSM_SPONSORED_ACCOUNT_LEVEL constant in the plugin file to match your sponsored level id.</li>\n<li>Edit the second half of the pmprosm_pmpro_after_change_membership_level() function to change the values of the discount code given to paying members.</li>\n</ol>\";s:3:\"FAQ\";s:323:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-sponsored-members/issues\">https://github.com/strangerstudios/pmpro-sponsored-members/issues</a></p>\";s:9:\"Changelog\";s:1991:\"<h4>Changelog</h4><p>0.10.1 - 2023-05-11</p><ul>\n<li>ENHANCEMENT: Adding a confirmation check before a child user is removed (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Now marking required child fields with asterisk at checkout (@kimwhite, @sensemonster)</li>\n<li>BUG FIX/ENHANCEMENT: Now extending discount code expiration date when sponsor level is renewed (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Now correctly handling plurals when localizing discount code uses text on the membership confirmation page (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Marking plugin as incompatible with Multiple Memberships Per User for the PMPro v3.0 update (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: Updating sample code to not have child level be the same as sponsoring level (@kimwhite)</li>\n<li>BUG FIX: Preventing exploit where child accounts for a sponsoring member would stay active if sponsoring member changed to a non-sponsor level (@dparker1005)</li>\n<li>BUG FIX: Fixing issue where child fields may not be hidden correctly at checkout (@JarrydLong, @dparker1005)</li>\n<li>BUG FIX: Resolving issue where the query to find child accounts for a user may return incorrect results if the user does not have a sponsor code (@JarrydLong)</li>\n<li>BUG FIX: Resolving PHP error on confirmation page when an existing sponsor checks out for a non-sponsoring level (@JarrydLong)</li>\n<li>BUG FIX: Resolving PHP error when an existing sponsor renews their membership without deciding to keep any old child accounts active (@JarrydLong)</li>\n<li>BUG FIX: Resolving issue where the <code>pmprosm_sponsored_code_settings</code> filter may sometimes be ignored (@dparker1005)</li>\n<li>BUG FIX: Removed <code>fixed</code> class from list table to resolve UI issues in some themes (@kimwhite)</li>\n<li>DEPRECATED: No longer documenting the <code>children_hide_email</code> setting as it hasn’t worked for the last few versions, but leaving the existing code in place in case a site is using it.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:80:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-sponsored-members.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:17:\"Sponsored Members\";}i:87;a:16:{s:4:\"Name\";s:45:\"Paid Memberships Pro - State Dropdowns Add On\";s:5:\"Title\";s:45:\"Paid Memberships Pro - State Dropdowns Add On\";s:9:\"PluginURI\";s:58:\"https://www.paidmembershipspro