ps Pro with Unlock Protocol.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:416:\"<h4>Changelog</h4><p>1.1.1 - 2023-01-10</p><ul>\n<li>ENHANCEMENT: Only show the \"Connect Wallet\" at checkout if the membership level allows NFT\'s to be purchased. If a level does not have a lock assigned, don\'t show the connect wallet button.</li>\n<li>BUG FIX: Fixed an issue when authenticating/connecting wallet would redirect to default checkout page and not the actual checkout URL that was being used.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:55:\"https://downloads.wordpress.org/plugin/pmpro-unlock.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:15:\"Unlock Protocol\";}i:92;a:16:{s:4:\"Name\";s:40:\"Paid Memberships Pro - User Pages Add On\";s:5:\"Title\";s:40:\"Paid Memberships Pro - User Pages Add On\";s:9:\"PluginURI\";s:51:\"http://www.paidmembershipspro.com/pmpro-user-pages/\";s:4:\"Slug\";s:16:\"pmpro-user-pages\";s:6:\"plugin\";s:37:\"pmpro-user-pages/pmpro-user-pages.php\";s:7:\"Version\";s:2:\".6\";s:11:\"Description\";s:88:\"When a user signs up, create a page for them that only they (and admins) have access to.\";s:12:\"Installation\";s:0:\"\";s:3:\"FAQ\";s:0:\"\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:74:\"https://license.paidmembershipspro.com/downloads/plus/pmpro-user-pages.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:10:\"User Pages\";}i:93;a:16:{s:4:\"Name\";s:46:\"Paid Memberships Pro - Variable Pricing Add On\";s:5:\"Title\";s:46:\"Paid Memberships Pro - Variable Pricing Add On\";s:9:\"PluginURI\";s:67:\"https://www.paidmembershipspro.com/add-ons/variable-pricing-add-on/\";s:4:\"Slug\";s:22:\"pmpro-variable-pricing\";s:6:\"plugin\";s:49:\"pmpro-variable-pricing/pmpro-variable-pricing.php\";s:7:\"Version\";s:5:\"0.4.5\";s:11:\"Description\";s:84:\"Allow customers to set their own price when checking out for your membership levels.\";s:12:\"Installation\";s:332:\"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-variable-pricing</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit the levels you want to add variable pricing to and set the \"Variable Pricing\" settings.</li>\n</ol>\";s:3:\"FAQ\";s:321:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-variable-pricing/issues\">https://github.com/strangerstudios/pmpro-variable-pricing/issues</a></p>\";s:9:\"Changelog\";s:311:\"<h4>Changelog</h4><p>0.4.5 - 2023-01-30</p><ul>\n<li>ENHANCEMENT: Improved translation logic within the plugin and translated some missing strings.</li>\n<li>ENHANCEMENT: Updated French translation (@paullaffitte).</li>\n<li>BUG FIX: Fixed an issue where PHP sessions were interfering with the REST API.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:79:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-variable-pricing.zip\";s:7:\"License\";s:4:\"plus\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:16:\"Variable Pricing\";}i:94;a:16:{s:4:\"Name\";s:30:\"Paid Memberships Pro - VAT Tax\";s:5:\"Title\";s:30:\"Paid Memberships Pro - VAT Tax\";s:9:\"PluginURI\";s:51:\"https://www.paidmembershipspro.com/add-ons/vat-tax/\";s:4:\"Slug\";s:13:\"pmpro-vat-tax\";s:6:\"plugin\";s:31:\"pmpro-vat-tax/pmpro-vat-tax.php\";s:7:\"Version\";s:5:\"0.7.1\";s:11:\"Description\";s:114:\"Calculate VAT tax at checkout and allow customers with a VAT Number lookup for VAT tax exemptions in EU countries.\";s:12:\"Installation\";s:572:\"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-vat-tax</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the <code>Plugins</code> menu in WordPress.</li>\n<li>Update your payment settings to make sure you are collecting billing address at checkout.</li>\n<li>If you are using a gateway like PayPal Express that doesn\'t collect a billing address, install and activate the Add Address for Free Levels addon.</li>\n</ol>\";s:3:\"FAQ\";s:692:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href=\"https://github.com/strangerstudios/pmpro-vat-tax/issues\">https://github.com/strangerstudios/pmpro-vat-tax/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:0:\"\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:70:\"http://license.paidmembershipspro.com/downloads/plus/pmpro-vat-tax.zip\";s:7:\"License\";s:8:\"standard\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:7:\"VAT Tax\";}i:95;a:16:{s:4:\"Name\";s:41:\"Paid Memberships Pro - WooCommerce Add On\";s:5:\"Title\";s:41:\"Paid Memberships Pro - WooCommerce Add On\";s:9:\"PluginURI\";s:61:\"https://www.paidmembershipspro.com/add-ons/pmpro-woocommerce/\";s:4:\"Slug\";s:17:\"pmpro-woocommerce\";s:6:\"plugin\";s:39:\"pmpro-woocommerce/pmpro-woocommerce.php\";s:7:\"Version\";s:3:\"1.8\";s:11:\"Description\";s:48:\"Integrate Paid Memberships Pro With WooCommerce.\";s:12:\"Installation\";s:2083:\"<p>Installation</p><p>Note: You must have <a href=\"https://wordpress.org/plugins/paid-memberships-pro/\">Paid Memberships Pro</a> and <a href=\"https://wordpress.org/plugins/woocommerce/\">WooCommerce</a> installed and activated on your site.</p>\n<h3>Install PMPro WooCommerce from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"PMPro WooCommerce\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"Paid Memberships Pro - WooCommerce Add On\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>Install PMPro WooCommerce Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-woocommerce</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"Paid Memberships Pro - WooCommerce\" through the \"Plugins\" menu in WordPress</li>\n<li>Go to \"after activation\" below.</li>\n</ol>\n<h3>After Activation: Configure Plugin Settings</h3><p>Create a Membership Product</p><ol>\n<li>Edit a product or add a new product.</li>\n<li>Select the \"Membership\" tab in the \"Product Data\" metabox.</li>\n<li>Select a level from the \"Membership Product\" dropdown.</li>\n<li>Save changes.</li>\n</ol><p>Set Member Discount Pricing on a Product</p><ol>\n<li>Edit a product or add a new product.</li>\n<li>Select the \"Membership\" tab in the \"Product Data\" metabox.</li>\n<li>Set a price for one or more levels in the \"Member Discount Pricing\" section.</li>\n<li>Save changes.</li>\n</ol><p>Set a Global Shop Discount for Members</p><ol>\n<li>Edit a membership level under Membership &gt; Settings.</li>\n<li>Locate the \"Set Membership Discount\" section.</li>\n<li>Add a percent discount to the field.</li>\n<li>Save changes.</li>\n</ol>\n<p>Visit our documentation site to <a href=\"https://www.paidmembershipspro.com/add-ons/pmpro-woocommerce/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-woocommerce\">learn more about the settings, access custom code recipes and tutorials, and view a list of compatibility with other Paid Memberships Pro Add Ons</a>.</p>\";s:3:\"FAQ\";s:311:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-woocommerce/issues\">https://github.com/strangerstudios/pmpro-woocommerce/issues</a></p>\";s:9:\"Changelog\";s:566:\"<h4>Changelog</h4><p>1.8 - 2023-07-10</p><ul>\n<li>ENHANCEMENT: Mark Paid Memberships Pro Integration with WooCommerce compatible with Custom Order Tables.</li>\n<li>ENHANCEMENT: Shows a message that the membership product is already in the cart when viewing the same product in the store.</li>\n<li>ENHANCEMENT: Stop Woocommerce subscription renewals from changing the user\'s membership level to the same level.</li>\n<li>BUG FIX: Fixed an issue where simple variation subscriptions were being discounted incorrectly, when set to not discount level products.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:35:\"https://www.paidmembershipspro.com/\";s:8:\"Download\";s:60:\"https://downloads.wordpress.org/plugin/pmpro-woocommerce.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:11:\"WooCommerce\";}i:96;a:16:{s:4:\"Name\";s:63:\"Paid Memberships Pro - WP Affiliate Platform Integration Add On\";s:5:\"Title\";s:63:\"Paid Memberships Pro - WP Affiliate Platform Integration Add On\";s:9:\"PluginURI\";s:83:\"https://www.paidmembershipspro.com/add-ons/pmpro-wp-affiliate-platform-integration/\";s:4:\"Slug\";s:27:\"pmpro-wp-affiliate-platform\";s:6:\"plugin\";s:59:\"pmpro-wp-affiliate-platform/pmpro-wp-affiliate-platform.php\";s:7:\"Version\";s:5:\"1.7.3\";s:11:\"Description\";s:70:\"Process an affiliate via WP Affiliate Platform after a PMPro checkout.\";s:12:\"Installation\";s:457:\"<p>Installation</p><ol>\n<li>Make sure that WP-Affiliate-Platform is activated and setup correctly.</li>\n<li>Upload the <code>pmpro-wp-affiliate-platform</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That\'s it! All orders from affiliates will have their affiliate id tracked in the PMPro order and will kick off conversions in WPAP.</li>\n</ol>\";s:3:\"FAQ\";s:331:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-wp-affiliate-platform/issues\">https://github.com/strangerstudios/pmpro-wp-affiliate-platform/issues</a></p>\";s:9:\"Changelog\";s:318:\"<h4>Changelog</h4><p>1.7.3 - 2023-01-05</p><ul>\n<li>ENHANCEMENT: Improved sanitization and escaping.</li>\n<li>BUG FIX: Fixed an issue where emails would not send when Paid Memberships Pro - WP Affiliate Platform Add On installed but WP Affiliate Platform was not/incorrectly configured. (@sc0ttkclark, @jjj)</li>\n</ul>\";s:6:\"Author\";s:36:\"Stranger Studios, Tips and Tricks HQ\";s:9:\"AuthorURI\";s:30:\"http://www.strangerstudios.com\";s:8:\"Download\";s:84:\"http://license.paidmembershipspro.com/downloads/free/pmpro-wp-affiliate-platform.zip\";s:7:\"License\";s:4:\"free\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:33:\"WP Affiliate Platform Integration\";}i:97;a:16:{s:4:\"Name\";s:38:\"WP Bouncer - Limit Simultaneous Logins\";s:5:\"Title\";s:38:\"WP Bouncer - Limit Simultaneous Logins\";s:9:\"PluginURI\";s:54:\"https://www.paidmembershipspro.com/add-ons/wp-bouncer/\";s:4:\"Slug\";s:10:\"wp-bouncer\";s:6:\"plugin\";s:25:\"wp-bouncer/wp-bouncer.php\";s:7:\"Version\";s:5:\"1.5.1\";s:11:\"Description\";s:93:\"Deter members from sharing login credentials: restrict simultaneous logins for the same user.\";s:12:\"Installation\";s:773:\"<p>Installation</p><p>***Install WP Bouncer from within WordPress</p>\n<ol>\n<li>Visit the plugins page within your dashboard and select \"Add New\"</li>\n<li>Search for \"WP Bouncer\"</li>\n<li>Locate this plugin and click \"Install\"</li>\n<li>Activate \"WP Bouncer\" through the \"Plugins\" menu in WordPress</li>\n</ol>\n<p>***Install WP Bouncer Manually</p>\n<ol>\n<li>Upload the <code>wp-bouncer</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate \"WP Bouncer\" through the \"Plugins\" menu in WordPress</li>\n</ol>\n<p>***Settings</p>\n<p>There are no settings for this plugin. If you want to modify the default behavior to instead enable JavaScript checks, add the following code to your wp-config.php:</p>\n<p>define( \'WP_BOUNCER_HEARTBEAT_CHECK\', true );</p>\";s:3:\"FAQ\";s:322:\"<p>Frequently Asked Questions</p><p>I need something strong to keep people from sharing accounts.</p><p>We\'ve found that using a 2-Factor-Authentication scheme on your site is a good way to keep people from sharing accounts. When we tried to design an advanced version of WP-Bouncer, it was basically 2FA. So try that.</p>\";s:9:\"Changelog\";s:427:\"<h4>Changelog</h4><p>1.5.1 - 2023-01-30</p><ul>\n<li>ENHANCEMENT: Added filter <code>wp_bouncer_ajax_timeout</code> to adjust timeout (default 5000).</li>\n<li>ENHANCEMENT: Added support for translations.</li>\n<li>BUG FIX: Removed unused login warning file and screenshot from the SVN repository that is not used in this plugin.</li>\n<li>BUG FIX: Fixed misspelled constant for plugin version and usage in JS file load.</li>\n</ul>\";s:6:\"Author\";s:16:\"Stranger Studios\";s:9:\"AuthorURI\";s:31:\"https://www.strangerstudios.com\";s:8:\"Download\";s:53:\"https://downloads.wordpress.org/plugin/wp-bouncer.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:38:\"WP Bouncer - Limit Simultaneous Logins\";}i:98;a:16:{s:4:\"Name\";s:36:\"Paid Memberships Pro - Zapier Add On\";s:5:\"Title\";s:36:\"Paid Memberships Pro - Zapier Add On\";s:9:\"PluginURI\";s:56:\"https://www.paidmembershipspro.com/add-ons/pmpro-zapier/\";s:4:\"Slug\";s:12:\"pmpro-zapier\";s:6:\"plugin\";s:29:\"pmpro-zapier/pmpro-zapier.php\";s:7:\"Version\";s:5:\"1.2.1\";s:11:\"Description\";s:83:\"Integrate activity on your membership site with thousands of other apps via Zapier.\";s:12:\"Installation\";s:460:\"<p>Installation</p><p>Prerequisites</p><ol>\n<li>Create a Zapier account at <a href=\"http://zapier.com\">http://zapier.com</a></li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-zapier</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>The settings page is at Memberships --&gt; PMPro Zapier in the WP dashboard.</li>\n</ol>\";s:3:\"FAQ\";s:547:\"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href=\"https://github.com/strangerstudios/pmpro-zapier/issues\">https://github.com/strangerstudios/pmpro-zapier/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href=\"http://www.paidmembershipspro.com\">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\";s:9:\"Changelog\";s:365:\"<h4>Changelog</h4><p>1.2.1 - 2022-08-12</p><ul>\n<li>ENHANCEMENT: New filter <code>pmproz_prepare_order_for_request</code> added to allow manipulating the $order data that is sent with every trigger.</li>\n<li>BUG FIX: Fixes an issue where order data would be blank in Zapier and similar services. Improved compatibility with v2.9+ of Paid Memberships Pro.</li>\n</ul>\";s:6:\"Author\";s:20:\"Paid Memberships Pro\";s:9:\"AuthorURI\";s:34:\"https://www.paidmembershipspro.com\";s:8:\"Download\";s:55:\"https://downloads.wordpress.org/plugin/pmpro-zapier.zip\";s:7:\"License\";s:13:\"wordpress.org\";s:18:\"HideFromAddOnsList\";s:1:\"0\";s:9:\"ShortName\";s:6:\"Zapier\";}}', 'no');
