"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:3:\"BSR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"https://www.bouncingsprout.com/?p=286\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:721:\"<p>We are so excited with Version 3.4 of Block, Suspend, Report for BuddyPress! Thanks to your feature requests, you can now report WordPress comments, and if you block someone, these will now be hidden. We&#8217;ve also finished the integration with bbPress; as well as being able to report bbPress topics and replies, these will now [...]</p>\n<p><a class=\"btn btn-secondary understrap-read-more-link\" href=\"https://www.bouncingsprout.com/25-off-enterprise-2022/\">Read More...</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.bouncingsprout.com/25-off-enterprise-2022/\">25% off to celebrate Version 3.4!</a> appeared first on <a rel=\"nofollow\" href=\"https://www.bouncingsprout.com\">Bouncingsprout Studio</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"bouncing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1979:\"\n<p>We are so excited with Version 3.4 of Block, Suspend, Report for BuddyPress!</p>\n\n\n\n<p>Thanks to your feature requests, you can now report WordPress comments, and if you block someone, these will now be hidden. We&#8217;ve also finished the integration with bbPress; as well as being able to report bbPress topics and replies, these will now also be hidden when you block their creators.</p>\n\n\n\n<p>We&#8217;ve added an option to allow suspended users to log in. We heard you wanted more flexibility around what happens with suspended users, and many of you wanted them to still be able to browse your sites. To help you with this, the Enterprise edition comes with action hooks so you can make things happen when a user is suspended (and unsuspended). You also now have the option of assigning a role whilst suspended. This means you now have complete control over what that user can do on your site, whilst their suspension is in force. Clever, eh?</p>\n\n\n\n<p>We&#8217;ve also added an option in the Block Settings to automatically cancel friendships when blocking someone. We know sites do things differently, so this will give you the flexibility to choose whether someone will have to re-friend someone if the unblock them.</p>\n\n\n\n<p>How does that sound? We are now convinced our moderation plugin is the best available, packed to the rafters with features. So, because we think you will be excited too, we are offering 25% of the <a href=\"https://www.bouncingsprout.com/plugins/block-suspend-report-for-buddypress#pricing\">Enterprise Edition</a>, with the coupon code:</p>\n\n\n\n<h2 class=\"has-text-align-center\"><a href=\"https://www.bouncingsprout.com/plugins/block-suspend-report-for-buddypress#pricing\">ENTERPRISE25</a></h2>\n\n\n\n<p></p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.bouncingsprout.com/25-off-enterprise-2022/\">25% off to celebrate Version 3.4!</a> appeared first on <a rel=\"nofollow\" href=\"https://www.bouncingsprout.com\">Bouncingsprout Studio</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://www.bouncingsprout.com/25-off-enterprise-2022/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:52:\"https://www.bouncingsprout.com/tag/bsr,plugins/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:48:\"WpOrg\\Requests\\Utility\\CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:7:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Mon, 24 Jul 2023 16:18:15 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:4:\"link\";s:165:\"<https://www.bouncingsprout.com/wp-json/>; rel=\"https://api.w.org/\", <https://www.bouncingsprout.com/wp-json/wp/v2/tags/25>; rel=\"alternate\"; type=\"application/json\"\";s:10:\"set-cookie\";s:93:\"ibx_wpfomo_ip=185.224.138.127; expires=Thu, 24-Aug-2023 16:18:14 GMT; Max-Age=2678400; path=/\";s:13:\"last-modified\";s:29:\"Tue, 05 Apr 2022 17:23:34 GMT\";s:4:\"etag\";s:34:\"\"298578c33611d3cd15c224dc432b2503\"\";}}s:5:\"build\";s:14:\"20230530150537\";}', 'no'),
