(64, 'payoneer_q2_2023', 'marketing', 'en_US', 'Grow with the next generation of payment processing', 'Ready to stand out in the new global economy? Payoneer Checkout gives you the power to securely accept payments worldwide, build a checkout that customers love, and manage your store’s transactions and finances – all from the same place.', '{}', 'pending', 'woocommerce.com', '2023-05-19 14:05:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'ipp_refresh_q2_2023_us_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the M2 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'unactioned', 'woocommerce.com', '2023-05-31 13:22:30', NULL, 0, 'plain', '', 0, 1, 'info'),
