(78, 'woocommerce_hpos_1st_notification_q2_2023', 'marketing', 'en_US', 'High-Performance Order Storage (HPOS) is on its way', 'Our team is targeting August 2023 to roll out a major database upgrade that can unlock faster checkout and order creation for your customers — and lightning-quick order lookup for you. Enablement is optional and you won’t be forced to update, but read on to see why this was our most requested new feature.', '{}', 'unactioned', 'woocommerce.com', '2023-06-07 14:05:21', NULL, 0, 'plain', '', 0, 0, 'info'),
(79, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-06-21 14:09:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(80, 'wc-admin-wcpay-sweden-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Sweden!', 'We’ve recently released WooCommerce Payments in Sweden. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-29 14:24:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(81, 'wc-admin-wcpay-bulgaria-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Bulgaria!', 'We’ve recently released WooCommerce Payments in Bulgaria. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(82, 'wc-admin-wcpay-czechia-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Czechia!', 'We’ve recently released WooCommerce Payments in Czechia. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(83, 'wc-admin-wcpay-croatia-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Croatia!', 'We’ve recently released WooCommerce Payments in Croatia. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(84, 'wc-admin-wcpay-hungary-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Hungary!', 'We’ve recently released WooCommerce Payments in Hungary. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(85, 'wc-admin-wcpay-romania-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Romania!', 'We’ve recently released WooCommerce Payments in Romania. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(86, 'tiktok-spc_june-2023', 'marketing', 'en_US', 'Take the guesswork out of TikTok advertising', 'Save time and create smarter ads using new automated campaign management from TikTok for WooCommerce. Simplify your campaign creation and watch TikTok’s machine learning build, target, and optimize ads that support your advertising goals — and grow your audience.', '{}', 'unactioned', 'woocommerce.com', '2023-06-30 15:52:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(87, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-05 15:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(88, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-06 15:10:44', NULL, 0, 'plain', '', 0, 0, 'info'),
(89, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-12 14:28:58', NULL, 0, 'plain', '', 0, 0, 'info'),
(90, 'square_payments_q3_2023', 'marketing', 'en_US', 'Square for WooCommerce', 'Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory — and manage everything through one centralized platform.', '{}', 'unactioned', 'woocommerce.com', '2023-07-19 14:20:32', NULL, 0, 'plain', '', 0, 0, 'info');
